INSERT INTO `pos_data_table` (`id`, `content`, `category`, `domain`, `url`, `date`) VALUES
(0, 'এ সময় লোকজনের মধ্যে আতঙ্ক ছড়িয়ে পড়ে ।  তবে এ আগুনে কেউ হতাহত হয়নি ।  বৈদ্যুতিক শর্টসার্কিট থেকে আগুনের সূত্রপাত হয়েছে বলে ফায়ার সার্ভিসের সদস্যরা জানিয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185262', '201301290000'),
(1, 'দ্বিতীয় খেলাটি বৃষ্টির জন্য মাঠে গড়াতে পারেনি ।  তাই তৃতীয় ম্যাচটি ছিল সিরিজ নির্ধারণী ।  অবশ্য শ্রীলঙ্কা আগেই এক ম্যাচ জিতে সিরিজ হেরে গিয়েছিল ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/03/30/23417', '201303300000'),
(2, 'গড়তে চান নতুন নিয়মও ! বিতর্ক তার ছায়াসঙ্গী ।  তিনি নিজেই তৈরি করেন বিতর্ক !', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/03/03/22989', '201303030000'),
(3, 'ভারতের বিখ্যাত নাট্যকার গিরিশ কারনাড রবীন্দ্রনাথকে দ্বিতীয় শ্রেণীর নাট্যকার বললেও বাংলাদেশে রবীন্দ্রনাথই যেন একমাত্র নাট্যকার ।  এরই দৃষ্টান্ত দেখা গেছে ২০১১ সালের মতো ২০১২ । ২০১২ সালেই প্রথম কলকাতার নাট্যোত্সব আমদানি করা হয়েছে ঢাকায় ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/01/02/22044', '201301020000'),
(4, 'গোলের স্থপতি পেদ্রো রদ্রিগুয়েজ ।  তার পাস মেসিকে খোঁজে পাওয়ার পর বাকি কাজ সহজেই সেরেছেন টানা বারবারের বিশ্ব সেরা ফুটবলার ।  ভেরানেকে এক ঝটকায় পেছনে ফেলে মেসির বাঁ পায়ের জোরালো ফেরানোর কোনা সুযোগই পান নি লোপেজ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/latestnews/2013/03/03/3319', '201303030000'),
(5, 'তবে আইএমএফের শর্তানুযায়ী সংস্থাটির ঋণ ঝুঁকিমুক্ত করতে মুরসিকে কঠোর অর্থনৈতিক সংস্কারের মধ্য দিয়ে যেতে হবে ।  গত নভেম্বরে আইএমএফের সঙ্গে সমঝোতা হওয়া ৪৮০ কোটি ডলারের ঋণ নিয়ে আলোচনা আবার শুরু করতে চায় বলে জানিয়েছে কায়রো ।  নভেম্বরের পর থেকে কায়রোজুড়ে শুরু হওয়া সহিংস প্রতিবাদের কারণে ঋণ নিয়ে ওই আলোচনা মিসর সরকারের অনুরোধে স্থগিত করা হয়েছিল ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190665', '201303050000'),
(6, 'আগের দিন বিনা উইকেটে ২৩ রান নিয়ে প্রথম ইনিংসে গতকাল দ্বিতীয় দিনের মতো ব্যাট করতে নামে বিসিবি নর্থ জোন ।  সবকটি উইকেট হারিয়ে দলীয় স্কোরে আর ২৫১ রান জমা পড়তেই দ্বিতীয় দিনের খেলা শেষ হওয়ার আগেই গুঁড়িয়ে যায় দলটি ।  বোলিং নৈপুণ্যে প্রথম ইনিংসে ৩ রানের লিড পায় সেন্ট্রাল জোন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189330', '201302240000'),
(7, 'দেশের জনগণের আবেগকে পুঁজি করে গণমাধ্যমগুলোর সহযোগিতায় তারা জনগণকে বিভ্রান্ত করার অপচেষ্টা চালায় ।  দেশপ্রেমী বিপ্লবী তরুণরা এই অপচেষ্টাকে রুখে দিতে ফেসবুক, ব্লগ ও অনলাইন মাধ্যমে ব্যাপক তত্পরতা পরিচালনা করে ।  এতে ভীত হয়ে পড়ে শাহবাগ আন্দোলনকারীরাও ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/18/188561', '201302180000'),
(8, 'নিজেদের চেয়ে শক্তির বিচারে এগিয়ে থাকা সেই নেপালকেই কাল তাদের মাটিতেই হারিয়ে এএফসি চ্যালেঞ্জ কাপের বাছাই পর্বে নিজেদের টিকিয়ে রাখল লাল-সবুজরা ।  ম্যাচে ২-০ গোলের জয় পায় লোড উইক ডি ক্রুইফ শিষ্যরা ।  দলের হয়ে শাখাওয়াত হোসেন রনি একাই গোল দুটি করেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190650', '201303050000'),
(9, 'রিয়ালের মাঠ সান্তিয়াগো বার্নাব্যুতে প্রথম লেগের ম্যাচে গোল পাওয়ায় শেষ আটের পথে অনেকটাই এগিয়ে রয়েছে কোচ স্যার অ্যালেক্স ফার্গুসনের দলটি ।  তবে টানা দুটি ‘এল ক্লাসিকো’ জিতে আত্মবিশ্বাসের পারদটা অনেক উঁচুতে রিয়ালের ।  চিরপ্রতিদ্বন্দ্বী বার্সেলোনার বিপক্ষে ওই দুটি জয় ওল্ড ট্রাফোর্ডে অনুপ্রেরণা জোগাবে রিয়ালকে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190652', '201303050000'),
(10, 'চলতি মৌসুমে ছয়টি এল ক্লাসিকোর মধ্যে এ নিয়ে তিনটিতেই জয় পেয়েছে দলটি ।  বার্সা জিতেছে মাত্র একটিতে ।  বাকি দুটি এল ক্লাসিকোতে ড্র করে দু’দল ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190450', '201303030000'),
(11, '২৬ মিনিটে আচমকা গোল হজম করতে হয় তাদের ।  কার্যত প্রথম আক্রমণেই গোল পেয়ে যায় গ্রানাডা ।  নলিটোর পাসে গোল করে স্বাগতিকদের এগিয়ে দেন নাইজেরিয়ান স্ট্রাইকার ওদিওন ইগহালো ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/18/188516', '201302180000'),
(12, 'টস জিতে প্রথমে ব্যাট করতে নামে অস্ট্রেলিয়া মহিলা দলের জডি ফিল্ডস ।  রাসেল হাইনেস ও জেস ক্যামেরুনের ব্যাটিং নৈপুণ্যে নির্ধারিত ৫০ ওভার শেষে ৭ উইকেট হারিয়ে ২৫৯ রানের ফাইটিং স্কোর দাঁড় করায় তার দল ।  ওপেনিং জুটিতে ৫২ রানের পার্টনারশিপ গড়ে অস্ট্রেলিয়াকে দারুণ একটি সূচনা এনে দেন মেগ ল্যানিং ও হাইনেস ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/18/188517', '201302180000'),
(13, 'এরপর দ্বিতীয় জুটিতে ৭৫ রানে পৌঁছায় তারা ।  প্রথম উইকেট পড়ার পর মাঠে আসা উইলিয়ামসনই দলের ভিত গড়ে যান ।  ৯৯ বলে ৭৪ রান করে রানআউটে কাটা পড়ে তার ইনিংস ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/18/188518', '201302180000'),
(14, 'লিগে সর্বোচ্চ উইকেট শিকারির তালিকায় যৌথভাবে শীর্ষেও রয়েছেন লঙ্কান এই পেসার ।  ডেভিড হাসির মতে, কাল থেকে শুরু হতে যাওয়া অস্ট্রেলিয়া-শ্রীলঙ্কার পাঁচ ওয়ানডে ম্যাচ সিরিজেও গতির ঝড় তুলবেন মালিঙ্গা ।  মেলবোর্ন স্টারসে একসঙ্গে খেললেও ওয়ানডে সিরিজে মালিঙ্গার প্রতিপক্ষ ডেভিড হাসি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/10/182130', '201301100000'),
(15, 'পালেকেল্লের তৃতীয় ওয়ানডেতে দুই ঘণ্টার বেশি সময় টানা বৃষ্টির পর বাংলাদেশের সমীকরণ দাঁড়ায় অবশিষ্ট ১৩.২ ওভারে ১০৫ রান ।  বৃষ্টি শেষে ম্যাচের পরিসর কমায় লক্ষ্য কমে দাঁড়ানোকে খুব বেশি গুরুত্ব দেননি বাংলাদেশ অধিনায়ক মুশফিকুর রহীম ।  বৃষ্টির সময় ড্রেসিংরুমে বসেই ম্যাচ জয়ের একটা ছক কষে ফেলেছিলেন মুশফিক ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194336', '201303300000'),
(16, 'চুক্তি শেষে প্রাইম ব্যাংকের পক্ষ থেকে গেইম অন স্পোর্টসকে অগ্রিম সাড়ে ৪ কোটি টাকার একটি ডামি চেক দেয়া হয় ।  পরক্ষণেই উন্মোচন করা হয় বিপিএলের দ্বিতীয় আসরের আনুষ্ঠানিক লগো ।  চুক্তিস্বাক্ষর অনুষ্ঠানে প্রাইম ব্যাংকের চেয়ারম্যান সিরাজুল ইসলাম মোল্লা বক্তব্য দেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180778', '201301020000'),
(17, 'সিডনিতে শ্রীলঙ্কাকে হোয়াইটওয়াশ করতেই মাঠে নামবে অজিরা ।  সিডনি টেস্টটা বিশেষভাবে গুরুত্বপূর্ণ হয়ে উঠেছে মাইক হাসির জন্য ।  টেস্ট ক্রিকেটকে বিদায় বলে দেয়ায় এই টেস্টই তার ক্যারিয়ারের শেষ টেস্ট ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180779', '201301020000'),
(18, 'রকিব হোসেন সিনেমার মায়ায় অরিন কখনও ভেবেছিলেন, এভাবে তার জীবন সিনেমাময় হয়ে উঠবে? সিনেমা ছাড়া আর কিছুই তার মাথায় ঢুকবে না? সিনেমার মায়ায় অবস্থা হবে তার পাগলপারা ?', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/01/10/1117', '201301100000'),
(19, 'আসলে এখন আর আগের মতো একের পর এক নাটকে কাজ করার ইচ্ছে নেই আমার ।  তাই আগের মতো একের পর এক নাটকে অভিনয় করছি না ।  নিজে থেকেই আসলে কাজ করা কমিয়ে দিয়েছি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194275', '201303300000'),
(20, 'কিন্তু নানা কারণে কাজ করা হয়ে ওঠেনি ।  বিপুলের কাজ সম্পর্কে আমার আগেই ধারণা ছিল ।  তারই ইচ্ছেতে আসলে কাজটি করা ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194276', '201303300000'),
(21, 'নাটকের কাহিনীতে দেখা যায়, অর্পা ভালোবাসে সোয়েব নামে এক বড় লোকের বখাটে ছেলেকে ।  ধনী বাবা-মায়ের সন্তান অর্পা (মেহজাবীন) বিয়ের আসর থেকে পালিয়ে যায় ।  রেলস্টেশনে গিয়ে অপেক্ষা করে সোয়েবের জন্য ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194280', '201303300000'),
(22, 'গুগল মাঝেমধ্যেই তার লোগোয় এ ধরনের পরিবর্তন এনে থাকে ।  বিশেষ করে কোনো বিশেষ দিবস, খ্যাতিমান কোনো ব্যক্তির জন্ম বা মৃত্যুবার্ষিকী, আশ্চর্য ঘটনা, কোনো দেশের জাতীয় দিবসকে সম্মান জানাতে গুগল তার লোগোয় বৈচিত্র্যময় পরিবর্তন আনে ।  গুগলের এ বিশেষ লোগোকে বলা হয় গুগল ডুডল ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193842', '201303270000'),
(23, 'মোহামেডান-শেখ জামাল ম্যাচটি গোলশূন্য ড্র ।  তাই এ গ্রুপের দুই জায়ান্টের আবার দেখা হচ্ছে সেমিফাইনালে ।  ফলে সেমিফাইনালে আবারও মুখোমুখি হতে হচ্ছে মোহামেডান-শেখ জামালকে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193874', '201303270000'),
(24, 'সিজেএফবি অ্যাওয়ার্ড বছরের শেষ পুরস্কার বিতরণী অনুষ্ঠান ।  এবার এই মর্যাদাজনক পুরস্কারের ১৩তম আসর ।  যুগ পেরিয়ে এই পুরস্কারের মূল্য এখন তারকাদের কাছে অনেক ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180740', '201301020000'),
(25, 'ব্যক্তিগত জীবনের অনেক গোপন তথ্য প্রকাশ হওয়ার পর সাফল্যের ট্র্যাক থেকে অনেকটা ছিটকে পড়েছিলেন ক্রীড়াজগতের অন্যতম এই ধনকুবের ।  টানা দুই বছর তিনি ছিলেন শিরোপাবঞ্চিত ।  শঙ্কায় পড়েছিলো ক্যারিয়ার ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193875', '201303270000'),
(26, 'আইপিএল শেষ হওয়ার আগে ইনজুরিমুক্ত হওয়ার কোনো সম্ভাবনাই নেই অসি অধিনায়কের ।  প্রায় দুই থেকে আড়াই মাস মাঠের বাইরে থাকতে হবে তাকে ।  ইনজুরিমুক্ত হয়ে অ্যাশেজে অংশগ্রহণের জন্য এমন সিদ্ধান্ত নিয়েছেন তিনি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193876', '201303270000'),
(27, 'টসে হেরে জিম্বাবুয়ের অধিনায়ক ব্রেন্ডন টেইলরের আমন্ত্রণে প্রথমে ব্যাটিংয়ের সুযোগ পায় স্বাগতিক ওয়েস্ট ইন্ডিজ ।  নবনির্বাচিত সরকারের ঘোষণায় শুক্রবার ক্যারিবীয় দ্বীপপুঞ্জে ছিল সরকারি ছুটির দিন ।  আর তাই সেন্ট জর্জের মাঠে উত্সবমুখর পরিবেশে আগত দর্শকরা ম্যাচটি উপভোগও করেছেন দারুণভাবে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189332', '201302240000'),
(28, 'ইতালির সঙ্গে ২-২ গোলে ড্রয়ের পর এবার রাশিয়ার সঙ্গেও ড্র করেছে তারা ।  সোমবার ব্রাজিলকে ১-১ গোলে রুখে দেয় রাশিয়ানরা ।  সর্বশেষ গত বছরের অক্টোবরে এশিয়ান জায়ান্ট জাপানের বিপক্ষে ৪-০ গোলে জয়ের দেখা পেয়েছিল ব্রাজিল ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193877', '201303270000'),
(29, 'এছাড়া ডাল, মুরগি ও আলুর দাম লাফিয়ে লাফিয়ে বেড়েই চলেছে ।  ভরা মৌসুমেও শীতকালীন শাকসবজির দাম আকাশছোঁয়া ।  সরকার বা অন্য কোনো পক্ষ থেকে নিত্যপণ্যের দাম পর্যবেক্ষণ ও নিয়ন্ত্রণ করার মতো কেউ নেই বলেই নিয়মনীতির তোয়াক্কা না করে ব্যবসায়ীরা লাগামহীনভাবে দাম বাড়িয়েই চলেছেন বলে জানিয়েছেন সংশ্লিষ্টরা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/10/182072', '201301100000'),
(30, 'গতকাল দ্বিতীয় দিন ব্যাট হাতে সেঞ্চুরির পথেই হাঁটছেন শচীনও ।  গতকাল দিনের খেলা শেষ হলে ৭১ রানে অপরাজিত থেকে মাঠ ছাড়েন তিনি ।  তার সঙ্গে বিরাট কোহলিও ব্যাটিং নৈপুণ্য দেখিয়েছেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189333', '201302240000'),
(31, 'এর আগে ১৯৯২ সালে স্বাগতিক নিউজিল্যান্ডের বিপক্ষে ওয়ানডে সিরিজ জিতেছিল ইংল্যান্ড ।  সেবার তিন ম্যাচ ওয়ানডে সিরিজে নিউজিল্যান্ডকে ৩-০ ব্যবধানে হোয়াইটওয়াশ করেছিল সফরকারীরা ।  গতকাল ইডেন পার্কে টসে হেরে আগে ব্যাট করতে নেমে ১৮৫ রানেই অলআউট হয়ে যায় নিউজিল্যান্ড ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189334', '201302240000'),
(32, 'কেউ মূল কপি না পেয়ে কিনছেন ফটোকপি ।  আবার কেউ ধার করছেন অন্যের কাছ থেকে ।  এসব ঘটনা এখন বিভিন্ন স্থানে নিয়মিত দৃশ্যে পরিণত হয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190624', '201303050000'),
(33, 'শুধু শিল্পী বললেই গুণী এই শিল্পীর যথাযথ মূল্যায়নে আমাদের অতৃপ্তি রয়ে যায় ।  গুণী এই শিল্পী আজকের যুগে অনেক শিল্পীরই অনুকরণীয় ।  একজন শিল্পী তখনই শতভাগ সফল, যখন তাকে প্রজন্মের পর প্রজন্মের শিল্পীরা অনুকরণ কিংবা অনুসরণ করতে থাকে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193779', '201303270000'),
(34, 'অভিনয়ের প্রথম দিকে নির্মাতারা শুধু শহুরে চরিত্রেই শারমীন শীলাকে ডাকতেন ।  কিন্তু তিনি সব চরিত্রে কাজ করা অভিনেত্রী হতে চেয়েছেন ।  তবে শারমীন শীলাকে এখন অভিনয়ে আগের মতো পাওয়া যায় না ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193780', '201303270000'),
(35, 'মন্ত্রী বলেন, ধানের দাম না বাড়লেও চালের দাম বেড়েছে ।  আমাদের ধারণা, সম্প্রতি শীত ও কুয়াশাকে অজুহাত দেখিয়ে মিলার ও আড়তদাররা চালের দাম বাড়িয়েছে ।  তবে তা নিশ্চিতভাবে বলতে পারছি না ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/10/182092', '201301100000'),
(36, 'বাবা টিভি থেকে মুখ ফিরিয়ে বললেন, ফোর্থ হয়েই এত খুশি উপরের তলার হাসান সাহেবের ছেলে ক্লাসে ফার্স্ট হয়েছে ।  আসাদের হাসিমুখ... আফতাব উদ্দিন বউ-শাশুড়ির সম্পর্ক একটি বীজ থেকে ছোট্ট দুই পাতার একটি চারা গাছের জন্ম হয় ।  তারপর শুরু হয় তার বেড়ে ওঠা, বিস্তৃতি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/03/03/1166', '201303030000'),
(37, 'জাতীয় অর্থনীতিতে ২১ শতাংশ অবদান রাখা আবাসন শিল্প কয়েক বছর ধরে ক্রমে অবনতির দিকে যাচ্ছে ।  দু’বছর আগে এ শিল্পের যে হারে অগ্রগতি হয়েছে, তাতে প্রবৃদ্ধি ৩০ শতাংশ হবে বলে অনুমান করা হয়েছিল ।  কিন্তু প্রবৃদ্ধি তো হয়ইনি, বরং গত বছরের ৭ শতাংশ নেমে এসেছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189296', '201302240000'),
(38, 'ঘরে বসে কাজ করা বেশ সহজও ।  প্রয়োজন শুধু একটি কম্পিউটার আর সঙ্গে উচ্চ ক্ষমতার ইন্টারনেট সংযোগ ।  এরপর প্রতিষ্ঠানের নেটওয়ার্কে যুক্ত হয়ে কাজ করাটা মোটেই কঠিন কিছু নয় ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190409', '201303030000'),
(39, 'এ ধারাবাহিকে তিনি ছিলেন হিমুর স্বামীর ভূমিকায় ।  নাটকের একটি দৃশ্য এমন ছিল যে, হিমু এক সময় জানতে পারে তার স্বামী আগে একটা বিয়ে করেছিল ।  আর এ নিয়ে স্বামীর ওপর তার গভীর অভিমান ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/02/24/1160', '201302240000'),
(40, 'এর আগেও দায়িত্বে অবহেলার জন্য তার বিরুদ্ধে শোকজ নোটিশ ইস্যু করেছিল নিয়ন্ত্রক সংস্থাটি ।  বার বার শোকজ নোটিশ পাওয়ার কারণে সিইওর দক্ষতা নিয়ে বড় ধরনের প্রশ্ন ওঠে ।  এ কারণে আগে থেকেই চাপের মুখে ছিলেন তিনি ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/10/182193', '201301100000'),
(41, 'অল-আউট হয়ে যায় স্থানীয় শ্রীলঙ্কা ডেভেলপমেন্ট এমারজিং টিম ।  সর্বসাকূল্যে প্রথম ইনিংসে দলটির সংগ্রহ দাঁড়ায় ৪১০ ।  টেলএন্ডার কাসুন মদুশঙ্কাকে মুশফিকুর রহিমের গ্লাভসবন্দি করার মধ্যদিয়ে এমারজিং টিমের ইনিংসের দাঁড়ি টানেন বাংলাদেশ দলের স্পিনার ইলিয়াস সানি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190651', '201303050000'),
(42, 'টটেনহ্যামের কাছে হেরে ৪৭ পয়েন্ট নিয়ে তালিকায় পাঁচ নম্বরে আছে আর্সেনাল ।  শিরোপা জয়ের রেসে সর্বোচ্চ ৭১ পয়েন্ট নিয়ে তালিকার শীর্ষে অবস্থান করছে ম্যানচেস্টার ইউনাইটেড ।  ম্যানইউ’র নগর প্রতিদ্বন্দ্বী ম্যানচেস্টার সিটি দুই নম্বরে রয়েছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190653', '201303050000'),
(43, 'জবাবে ৬ উইকেট হারিয়ে ১১৭ রানে থেমে যায় জিম্বাবুয়ের ইনিংস ।  জিম্বাবুয়ের বিপক্ষে এই জয়ে উচ্ছ্বসিত উইন্ডিজ অধিনায়ক ড্যারেন সামি ।  তিনি বলেছেন, ওয়েস্ট ইন্ডিজ বিশ্বচ্যাম্পিয়নের মতোই খেলেছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190658', '201303050000'),
(44, 'আট বছরের মধ্যে আবারও এই শিরোপা জিতে দারুণ উচ্ছ্বসিত নাদাল ।  এই নিয়ে দ্বিতীয়বার মেক্সিকান ওপেন শিরোপা ঘরে তুলেছেন তিনি ।  ম্যাচ শেষে নাদাল বলেন, এই জয়ে সপ্তাহটি দারুণ কেটেছে আমার ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190659', '201303050000'),
(45, 'স্টেডিয়ামের জমাট বাঁধা সেই পানিই যেন গতকাল সৌভাগ্যের প্রতীক হয়ে দেখা দেয় আবাহনীর সামনে! শিরোপা লড়াইয়ের মহাগুরুত্বপূর্ণ এ ম্যাচের ৯০ মিনিট পর্যন্ত ০-১ গোলে পিছিয়ে ছিল আবাহনী ।  শেখ রাসেল শিবির জয়োত্সবের প্রস্তুতি নিচ্ছিল ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/18/188514', '201302180000'),
(46, 'রাজনৈতিক অস্থিরতার কারণে সম্প্রতি শেয়ারবাজারে বড় ধরনের দরপতনের ঘটনা ঘটছে ।  কিন্তু অস্থিরতা বজায় থাকা সত্ত্বেও গতকাল শেয়ারবাজারে সূচকের বড় ধরনের উত্থানকে স্বাভাবিক বলে মনে করছেন না বাজার সংশ্লিষ্টরা ।  তারা মনে করেন, কৃত্রিমভাবে বাজারকে ধরে রাখার প্রচেষ্টা ছিল ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190673', '201303050000'),
(47, 'বাংলাদেশ ব্যাংকও মানি মার্কেট ঠিক রেখে পুঁজিবাজারকে সহায়তা করতে পারে ।  এ বিষয়ে ভালো আলোচনা হয়েছে উল্লেখ করে এসকে সুর বলেন, বাংলাদেশ ব্যাংক পুঁজিবাজারের উন্নয়নে সহায়তা করছে ।  আগামীতেও সহায়তা করা হবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190674', '201303050000'),
(48, 'সব সংগঠনকে তাদের প্রস্তাব লিখিত আকারে এফবিসিসিআই’র কাছে দাখিল করতে অনুরোধ করা হয়েছে ।  এফবিসিসিআই থেকে প্রাপ্ত প্রস্তাব বাজেট প্রণয়নের সময় বিবেচনা করা হবে ।  তবে যেসব প্রতিষ্ঠান বা ব্যক্তি এফবিসিসিআইয়ের সদস্য নয় তারা সরাসরি প্রধান বাজেট সমন্বয়কারী প্রথম সচিব (মূসক) আল আমিন প্রামাণিকের কাছে প্রস্তাব পেশ করতে পারবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/05/190677', '201303050000'),
(49, 'অবশ্য শ্রীলঙ্কা আগেই এক ম্যাচ জিতে সিরিজ হেরে যাওয়ার শঙ্কা থেকে মুক্তি পেয়েছিল ।  বাংলাদেশের সামনে ছিল ম্যাচ জিতে সিরিজে সমতা আনার হাতছানি ।  এ কাজটি টাইগাররা সুষ্ঠুভাবে সম্পন্ন করতে পেরেছে বৃষ্টিবিঘ্নিত তুমুল প্রতিদ্বন্দ্বিতাপূর্ণ ম্যাচটি জিতে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194367', '201303300000'),
(50, 'এবার বেড়ে যাচ্ছে মাছসহ শাক-সবজির দাম ।  বাজারে গ্রীষ্মকালীন সবজি আসা শুরু করলেও দাম এখনও নাগালের বাইরে ।  ব্যবসায়ীদের আশঙ্কা, রাজনৈতিক পরিবেশ অশান্ত থাকলে বেশকিছু পণ্যের বাজারদর আরও আক্রা হয়ে উঠতে পারে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190334', '201303030000'),
(51, 'তালিকায় বার্সার অর্জন সর্বোচ্চ ৭৪ পয়েন্ট ।  এ পর্যন্ত মোট ২৮ ম্যাচ খেলে ২৪টিতেই জয় পেয়েছে কাতালানরা ।  বাকি দুই ম্যাচে ড্র এবং দুটিতে হেরেছে কোচ টিটো ভিলানোভার দলটি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194339', '201303300000'),
(52, 'শক্তিশালী ফিলিস্তিনের বিপক্ষে বাংলাদেশ রক্ষণাত্মক মেজাজে খেলে ।  ৪-৩-২-১ পদ্ধতিতে বাংলাদেশের ডাচ কোচ ডি ক্রুইফ দল সাজান ।  ম্যাচের শুরুতেই বাংলাদেশের ডিফেন্ডার লিঙ্কন ফিলিস্তিনের ইলিয়াডকে ফাউল করলে ফ্রিকিক পায় তারা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190353', '201303030000'),
(53, 'এবারের লঙ্কা সফরে বাংলাদেশ দলের অধিকাংশ খেলোয়াড়ই তরুণ ।  এদের মধ্যে এনামুল হক বিজয়, মমিনুল হক, সোহাগ গাজী, মার্শাল আইয়ুব অন্যতম ।  তরুণদের ওপরই আস্থা রাখছেন বাংলাদেশ দলের অধিনায়ক মুশফিকুর রহিম ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190354', '201303030000'),
(54, 'আগামী ১৭ এপ্রিল থেকে ১২ মে জিম্বাবুয়ে সফরে থাকবে বাংলাদেশ ।  ওই সময় এনামুল ব্যস্ত থাকবেন পরীক্ষা নিয়ে ।  এদিকে এনামুলের পরিবর্তে একমাত্র টি-টোয়েন্টি ম্যাচে অংশ নিতে অন্য কাউকে শ্রীলঙ্কায় পাঠানো হচ্ছে না বলে নিশ্চিত করেছে বিসিবি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194344', '201303300000'),
(55, 'বাঁহাতি স্পিনার জাদেজা পান তিন উইকেট ।  হরভজন সিং পেয়েছেন দুটি ।  অপর একটি উইকেট পেয়েছেন প্রথম টেস্টে অস্ট্রেলিয়ার ব্যাটিং লাইনআপে ধস নামানো অফস্পিনার রবিচন্দ্রন অশ্বিন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190355', '201303030000'),
(56, 'বঙ্গবন্ধু জাতীয় স্টেডিয়ামে বিকাল সাড়ে ৪টায় হবে এ ম্যাচ ।  পয়েন্ট টেবিলের দিকে তাকালে দেখা যায়, ৫ ম্যাচে ৫ পয়েন্ট নিয়ে টিম বিজেএমসি আছে ষষ্ঠস্থানে ।  তবে গোপীবাগের তারুণ্যদীপ্ত দল কমলা জার্সিধারী ব্রাদার্স ইউনিয়নের অবস্থা খুবই শোচনীয় ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180780', '201301020000'),
(57, 'টানা পাঁচ ঘণ্টা অবিরাম বৃষ্টি হওয়ায় প্রথম টি-টোয়েন্টি ম্যাচটি পরিত্যক্ত ঘোষণা করা হয় ।  এবারের দক্ষিণ আফ্রিকা সফরে এ পর্যন্ত ভালো কাটেনি পাকিস্তানের ।  তিন ম্যাচের টেস্ট সিরিজের প্রত্যেকটিতে হেরেছে মিসবাহ-উল হক বাহিনী ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190357', '201303030000'),
(58, 'উইজডেন ইন্ডিয়া আলমানক নামক একটি ম্যাগাজিনের উদ্বোধনী অনুষ্ঠানের পর এক আলোচনা সভায় গাঙ্গুলি বলেন, এটা কোনো নির্দিষ্ট ব্যক্তির ব্যাপার নয় ।  তবে আমি মনে করি ভারতীয় একজনকে দলের কোচ হিসেবে নিয়োগ দেয়ার সময় এসেছে ।  আগামী বছর মার্চ মাসে ফ্লেচারের সঙ্গে দুই বছরের মেয়াদ  ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180782', '201301020000'),
(59, 'সীমিত ওভারের মতো লংভার্সনের ক্রিকেটেও কিউইদের বিপক্ষে মাঠে আধিপত্য বিস্তার করতে চায় আইসিসির টেস্ট র্যাংকিংয়ের শীর্ষে থাকা দক্ষিণ আফ্রিকা ।  অনেকের ধারণা, কিউই-প্রোটিয়া দুই ম্যাচ টেস্ট সিরিজের লড়াইটা একপেশে হতে পারে ।  এই ধারণার মূল কারণ আর কিছুই নয়, অতীত পরিসংখ্যান ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180783', '201301020000'),
(60, 'এ ম্যাচে সুইডিশ তারকা জল্গাতান ইব্রাহিমোভিচের দেয়া শেষ মুহূর্তের গোলের পেছনে বেকহ্যামের অবদান ছিল অনবদ্য ।  এছাড়া বুধবার ফ্রেঞ্চ কাপে এই মার্সেইর বিপক্ষে একই ব্যবধানে জয়ী ম্যাচে পুরো ৮৬ মিনিট মাঠে ছিলেন বেকহ্যাম ।  এ সময় তার পারফরম্যান্স ছিল চোখে পড়ার মতো ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190358', '201303030000'),
(61, 'এ পতনের ফলে টানা দু’দিন ঊর্ধ্বমুখী থাকার পর সূচকের পতন হয়েছে ।  এদিকে গত সপ্তাহের শেষ কার্যদিবসে ডিএসইতে সাড়ে ৫০০ কোটি টাকার বেশি লেনদেন হলেও গতকাল তা ৫০০ কোটি টাকার নিচে নেমে এসেছে ।  আগের দিনের তুলনায় প্রায় ১০০ কোটি টাকা কমে দিন শেষে লেনদেন হয়েছে ৪৫৩ কোটি ৯০ লাখ টাকা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/18/188464', '201302180000'),
(62, 'পাকিস্তানে ক্রমাগতভাবে সহিংস ঘটনা বন্ধ না হওয়ায় বিসিবি এ সিদ্ধান্ত নিয়েছে বলে উল্লেখ করেন পাপন ।  ঠিক কতদিনে বাংলাদেশ পাকিস্তান সফরে যাবে তাও খোলাসা করে কিছু বলেননি বিসিবি সভাপতি ।  বিসিবির এ সিদ্ধান্তের খবর শোনার পরক্ষণই ক্ষেপে ওঠেন পিসিবি প্রেসিডেন্ট জাকা আশরাফ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180785', '201301020000'),
(63, 'নাদালের সামনে এখন ক্যারিয়ারে ৫২তম এটিপি ট্যুর শিরোপা জয়ের দারুণ সুযোগ ।  মাত্র ৪৮ মিনিটে আলমাগ্রোকে ৭-৫, ৬-৪ গেমে হারিয়ে সেমিফাইনালের বাধা উতরান নাদাল ।  ৩৮তম ক্লে কোর্ট শিরোপায় চোখ রাখা স্প্যানিশ তারকা নাদাল ম্যাচশেষে বলেন, ‘আমি কিছুটা স্নায়ুচাপ নিয়ে ম্যাচ শুরু করেছিলাম ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190360', '201303030000'),
(64, 'আর আবাহনীর বিপক্ষে লড়াই করবে আরামবাগ ।  গতকাল গ্রুপ পর্বে নিজেদের শেষ ম্যাচে বঙ্গবন্ধু জাতীয় স্টেডিয়ামে নাছরিন স্পোর্টিং ক্লাবের বিরুদ্ধে মাঠে নামে সকার ক্লাব ।  ম্যাচের শুরু থেকেই প্রতিপক্ষের ওপর চাপ প্রয়োগ করে খেলা শুরু করে সকার ক্লাব ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190365', '201303030000'),
(65, 'হিন্দি ছবির প্রতি শোভন বরাবরই দুর্বল ।  তাই বাজারের একটি ক্যাসেট দোকান থেকে শোভন যোধা আকবর ছবির সিডি কিনে নিয়ে এলো ।  রাত ১০টার দিকে শোভন ড্রইং রুমে একা যোধা আকবর ছবিটি দেখতে বসেছে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/18/188449', '201302180000'),
(66, '১৫টি চারের সাহায্যে ১২১ রানের অনবদ্য ইনিংস খেলেন প্রোটিয়া এই সহঅধিনায়ক ।  তা ছাড়া হাশিম আমলা ৯২ ও ভারনন ফিল্যান্ডার ৭৪ রানের ইনিংস খেলেন ।  বল হাতে পাকিস্তানি পেসার রাহাত আলী দারুণ পারফরমেন্স দেখিয়েছেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189335', '201302240000'),
(67, 'শেষ ম্যাচে দুর্দান্ত পারফর্ম করে স্বাগতিক ব্যাটসম্যান ও বোলাররা বেকায়দায় ফেলে দিয়েছিল ইংলিশদের ।  ২৯ বছর পর নিজেদের মাঠে সিরিজ জয়ের স্বপ্ন দেখতে শুরু করেছিল নিউজিল্যান্ড সমর্থকরা ।  কিন্তু সেটা আর হয়ে ওঠেনি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193878', '201303270000'),
(68, 'কিন্তু যারা আমাদের দেশের জন্য নিজেদের জীবন বিসর্জন দিয়েছেন, তারা জাতির শ্রেষ্ঠ সন্তান ।  আমরা অনেকেই জানি সাতজন বীরশ্রেষ্ঠ রয়েছেন ।  কিন্তু অনেকেই হয়তো তাদের নামগুলো একের পর এক বলে যেতে পারব না ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194274', '201303300000'),
(69, 'স্বল্প বাজেটে হাতে গোনা কয়েকটি দল নিয়ে মহিলা হকির দ্বিতীয় আসর আয়োজন করছে ফেডারেশন ।  আগামীকাল সোমবার আনন্দময়ী বালিকা উচ্চ বিদ্যালয় ও নাহার একাডেমির ম্যাচ দিয়ে পর্দা উঠবে এবারের আসরের ।  পাঁচ দল নিয়ে আয়োজিত লিগের শিরোপা নির্ধারণী ম্যাচ অনুষ্ঠিত হবে ৪ মার্চ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189338', '201302240000'),
(70, '২০০৯ সালের ফাইনালে সার্বিয়ান তারকা নোভাক জোকোভিচকে হারিয়ে শিরোপা জিতেন তিনি ।  গত বছর জোকোভিচের কাছে হেরেই শিরোপা হাতছাড়া হয়েছিল তার ।  তবে এবারও শিরোপা জয়ের দিকে এগিয়ে যাচ্ছেন গত বছরের ফাইনালিস্ট মারে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193879', '201303270000'),
(71, 'মাঝেমধ্যে একটু-আধটু নাটকে কাজ করলেও সেখানে তার বিরুদ্ধে অভিযোগের অন্ত নেই ।  শুটিং স্পটে যথাসময়ে না যাওয়া, সেটে গিয়ে মনোযোগ দিয়ে কাজ না করা ইত্যাদি যেন শায়নার অভ্যাসে পরিণত হয়েছে ।  ফলে নির্মাতাদের অনেকেই তাকে নিয়ে কাজ করার আগ্রহ হারিয়ে ফেলেছেন ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194277', '201303300000'),
(72, 'প্রোটিয়াসদের রেটিং পয়েন্ট ১২৮ ।  নিউজিল্যান্ডে ভাগ্যের জোরে তিন ম্যাচের টেস্ট সিরিজ ‘ড্র’ করলেও ইংল্যান্ড টেস্ট র্যাংকিংয়ের দ্বিতীয় স্থানে রয়েছে ।  ইংলিশদের ঝুলিতে ১১৪ পয়েন্ট ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193880', '201303270000'),
(73, 'সারারাত ঘুমাতে পারল না ।  প্রচণ্ড পানির পিপাসায় একটু পরপর তার গলা শুকিয়ে যায় ।  পানি খায় আর হলের বারান্দায় হাঁটাহাঁটি করে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194279', '201303300000'),
(74, 'মিসবাহও বিষয়টি নিয়ে অস্বস্তির মধ্যে ছিলেন ।  তবে পাকিস্তান ক্রিকেট বোর্ডের (পিসিবি) চেয়ারম্যান জাকা আশরাফের মুখ থেকে আশার বাণী শুনে বেশ স্বস্তিতেই আছেন মিসবাহ ।  আগামী জুনে ইংল্যান্ডে অনুষ্ঠেয় চ্যাম্পিয়ন্স ট্রফিতে তাকেই অধিনায়ক হিসেবে রাখছে পিসিবি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193886', '201303270000'),
(75, 'এসব জমির দামও খুব চড়া ।  প্রতি শতক জমি ২ থেকে ৫ লাখ টাকায় বিক্রি হচ্ছে ।  গুমাইবিল এলাকার সড়কের দু’পাশে শতাধিক প্লট করে প্রায় ৫০ একর জমি ইট দিয়ে সীমানা প্রাচীর করে রাখা হয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194375', '201303300000'),
(76, 'যেসব ব্যক্তির আয় দুই লাখ থেকে পাঁচ লাখ তাদের মাত্র দুই হাজার রুপি দিতে হবে ।  ভারতের এক কোটি ৮০ লাখ করদাতা এ সুযোগ ভোগ করবে ।  আর এতে বিগত বাজেটের তুলনায় নতুন অর্থবছরে তিন হাজার ৬শ’ কোটি রুপি রাজস্ব আয় কমবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190329', '201303030000'),
(77, 'ওই চালান দুটিতেও প্রায় আড়াই কোটি টাকার রাজস্ব ফাঁকি দেয়ার চেষ্টা করেছিল প্রতিষ্ঠানটি ।  কাস্টমস সূত্র জানায়, গতকাল চট্টগ্রাম বন্দর দিয়ে সাকিব প্যাকেজিং অ্যান্ড এক্সেসরিজের আমদানি করা কনটেইনার খালাসের আগে কায়িক পরীক্ষাকালে শতভাগ ঘোষণা বহির্ভূত পণ্যের প্রমাণ মেলে ।  এরপর চালানটি জব্দ করা হয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194379', '201303300000'),
(78, 'দেশের মানুষকে আদি সংস্কৃতির দিকে অনুপ্রাণিত করার বাইরেও তিনি গান করেন ।  তবে তার বিশেষ ভালোলাগা তিন কবির গান ।  লুভা নাহিদ চৌধুরীর সাক্ষাত্কার নিয়েছেন রকিব হোসেন আপনি বেঙ্গল ফাউন্ডেশনের মহাপরিচালক ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180741', '201301020000'),
(79, 'এর চেয়ে সেরা প্রাপ্তি আর কী হতে পারে! আমি অনেক দিন চোরাবালিকে আমার স্বপ্নে লালন করেছি ।  এখন সেটা সবার মাঝে ছড়িয়ে দিতে পেরেছি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180742', '201301020000'),
(80, 'বাংলাদেশ ব্যাংকের সর্বশেষ প্রকাশিত ডিসেম্বরভিত্তিক প্রতিবেদন থেকে এ তথ্য জানা গেছে ।  প্রতিবেদনে দেখা যায়, ডিসেম্বর শেষে শিল্পখাতে মোট ঋণের স্থিতি দাঁড়িয়েছে ১ লাখ ৬৫ হাজার ৫৯৫ কোটি টাকা ।  এ সময়ে আদায় হয়েছে ৫৭ হাজার ২৯৮ কোটি টাকা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/03/190347', '201303030000'),
(81, 'অথচ রবীন্দ্রনাথ প্রায় সারা জীবনই ব্রিটিশদের আনুকূল্য লাভে আগ্রহী ছিলেন ।  এমনকি তার নাইটহুড খেতাব প্রত্যাখ্যানের পেছনে ব্রিটিশবিরোধী মনোভাব কার্যকর ছিল না । তবে ঈশা খাঁর আমলে মুঘল সম্রাটের যুগে প্রজাদের ওপর পাশবিক নির্যাতনের কোনো প্রমাণ পাওয়া  যায় নি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180746', '201301020000'),
(82, 'রবীন্দ্রনাথ কবি হিসেবে অতুলনীয় হলেও নাট্যকার হিসেবে তিনি দ্বিতীয় শ্রেণীর, একেবারেই নিজের মান রাখতে পারেননি ।  ওনার লেখা নাটক পড়া যায় না ।  এত ড্রামা আর মেলোড্রামার ছড়াছড়ি যে, একটা সময়ের পর সেই লেখা হজম করা দায় ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180748', '201301020000'),
(83, 'সচেতন মহল হতবাক হয়েছে এ ঘটনায় ।  গত ১৪ থেকে ২২ সেপ্টেম্বর সরকারি পৃষ্ঠপোষকতায় বাংলাদেশ শিল্পকলা একাডেমীতে অনুষ্ঠিত হয়েছে ৯ দিনব্যাপী এ উত্সব ।  গত কয়েক বছর ধরে কলকাতার একটি নাট্যদল কলকাতায় এই গঙ্গা-যমুনা নাট্যোত্সব করে আসছে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/02/180749', '201301020000'),
(84, 'প্রতি বিঘায় ৩০ হতে ৩৫ বস্তা আলু উত্পাদন হওয়ায় কৃষকের মুখে হাসি ফুটলেও দরপতন ঘটায় সে হাসিকে ম্লান করে দিয়েছে ।  এদিকে আলু প্রতি ৯০ কেজি ওজনের বস্তার মূল্য ৩০০ থেকে ৩২৫ টাকা দরে বিক্রি হচ্ছে ।  এতে লোকসান গুণতে হচ্ছে আলু চাষীদের ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/30/194266', '201303300000'),
(85, 'কেন্দ্রীয় ব্যাংক সূত্র জানিয়েছে, গ্রাহকের সুবিধার্থে সেবার নাম ও বৈশিষ্ট্য উল্লেখ করে কি পরিমাণ সার্ভিস চার্জ কাটা হবে তা সুস্পষ্ট করার উদ্যোগ নেয়া হয়েছে ।  ব্যাংকগুলোকে হিসাব খোলার ফরমের পাশাপাশি সার্ভিস চার্জ বা মূল্যের বিনিময়ে ব্যাংকিং সেবা প্রদানের আলাদা একটি ফরমে সম্মতিপত্র নিতে হবে ।  যাতে কোনো ব্যাংক বা আর্থিক প্রতিষ্ঠান গ্রাহকের সম্মতি না নিয়ে কোনো প্রকার চার্জ কাটতে না পারে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/10/182153', '201301100000'),
(86, 'বিসিসিআই’র সঙ্গে আমরা ভালো সম্পর্ক গড়তে চাই ।  টেকনিক্যাল স্টাফ, কোচ উন্নয়নে আমরা তাদের সহায়তা চাই । ’ ক্রিকেট ক্লাব অব ইন্ডিয়ায় (সিসিআই) অনুষ্ঠিত বৈঠকে এসিবির হাই পারফরম্যান্স প্রোগ্রাম ম্যানেজার বশির স্তানেকজিও উপস্থিত ছিলেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189289', '201302240000'),
(87, 'কে হবেন সেই গাড়ির মালিক ? এই প্রশ্নের উত্তর জানার প্রতীক্ষা এখন ।  আর এই প্রতীক্ষার অবসান ঘটবে ১২ জানুয়ারি । ', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/10/182157', '201301100000'),
(88, 'বিসিআইএম সদস্য দেশগুলোর মাঝে অনেক সম্ভাবনা রয়েছে ।  এসব সম্ভাবনাকে কাজে লাগিয়ে উত্পাদনমুখী অর্থনীতির প্রসার ঘটাতে হবে । এক দেশের পণ্য অন্য সদস্য দেশে নিয়ে নতুন নতুন বাজার সৃষ্টি করতে হবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189295', '201302240000'),
(89, 'অনলাইনে এই অ্যাকাউন্টগুলোর রয়েছে লক্ষাধিক ফলোয়ার ।  হ্যাকড হওয়া বিবিসি অ্যারাবিক অনলাইন অ্যাকাউন্ট থেকে প্রায়ই আসাদবিরোধী পোস্ট করা হতো ।  হ্যাকার দলটি সিরিয়ার প্রেসিডেন্ট বাশার আল-আসাদের সমর্থক বলে জানা গেছে ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193906', '201303270000'),
(90, 'সম্প্রতি বাজুসের সাধারণ সভায় স্বর্ণের নতুন দাম নির্ধারণ করা হয় ।  শুক্রবার থেকে স্বর্ণের নতুন দাম কার্যকর হয়েছে ।  এর আগে গত বছরের শেষ দিনে স্বর্ণের দাম কমানোর ঘোষণা দেয় বাজুস ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/24/189298', '201302240000'),
(91, 'সরকারের শেষ বছরে বিরোধীদলীয় জোটের একের পর হরতালে ব্যবসা-বাণিজ্যে স্থবিরতা নেমে এসেছে ।  এ অবস্থায় পোশাক শিল্পমালিকদের সংগঠন বিজিএমইএ, বিকেএমইএ, বিটিএমএর নেতারা রফতানিসংশ্লিষ্ট কর্তৃপক্ষ শনিবার খোলা রাখার সুপারিশ করেছিল ।  সে আলোকে অর্থমন্ত্রী এ সিদ্ধান্ত দেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193914', '201303270000'),
(92, 'অন্যদিকে ২০১৩-১৪ অর্থবছরের জন্য বাজেট প্রণয়নের প্রক্রিয়াও শুরু হয়েছে ।  আগামী অর্থবছরের বিশাল আকারের যে বাজেট প্রণয়নের পরিকল্পনা করা হচ্ছে, তাতে অর্থের জোগান দিতে রাজস্ব আদায়ের লক্ষ্যমাত্রা আরও বাড়ানোর প্রয়োজন হবে ।  নতুন অর্থবছরের রাজস্ব নীতি এবং রাজস্ব আদায়ের লক্ষ্যমাত্রা নির্ধারণের বিষয়ে কর্মকর্তাদের মতামত নেয়া হবে ওই বৈঠকে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/27/193915', '201303270000'),
(93, 'বিসিসিআই’র সঙ্গে আমরা ভালো সম্পর্ক গড়তে চাই ।  টেকনিক্যাল স্টাফ, কোচ, আম্পায়ার্স, স্কোরার্স ও ভিডিও অ্যানালাইসি উন্নয়নে আমরা তাদের সহায়তা চাই ।  ক্রিকেট ক্লাব অব ইন্ডিয়ায় (সিসিআই) অনুষ্ঠিত বৈঠকে এসিবির হাই পারফরম্যান্স প্রোগ্রাম ম্যানেজার বশির স্তানেকজিও উপস্থিত ছিলেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/24/10178', '201302240000'),
(94, 'এটা ফেব্রুয়ারি মাস, তাতে কী ? তাতে কী মানে ? তুই জানিস না এটা আমাদের ভাষা আন্দোলনের মাস ?', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/05/10205', '201303050000'),
(95, 'এর ঐতিহ্যবাহী সৌন্দর্য এখনও সমাদৃত ।  শুধু দেশে নয়, বিদেশিদেরও আমাদের জামদানির প্রতি আগ্রহ বেশি ।  আমাদের সবার জামদানির এ ঐতিহ্যকে ধরে রাখতে হবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/02/9691', '201301020000'),
(96, 'তুই নাকি কিসের অ্যাকাউন্ট খুলতে বলছিস? টাকা পাঠালে আমার অ্যাকাউন্টে পাঠিয়ে দে, ও এই বয়সে কিসের অ্যাকাউন্ট খুলবে? নাইম ভয়ে ফোন রেখে দেয়, খালাকে বোঝানো তার পক্ষে সম্ভব না ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/30/10396', '201303300000'),
(97, 'পাশাপাশি অন্যরকম ভালোবাসা চলচ্চিত্রে অভিনয় করেছেন নবীন নায়ক বাপ্পী ও নায়িকা মাহি ।  প্রথম সপ্তাহ পার করে দুটি চলচ্চিত্রই এখন দ্বিতীয় সপ্তাহ চলছে ।  দেবদাস ও অন্যরকম ভালোবাসা দুটিই রোমান্টিক ঘরানার চলচ্চিত্র ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/05/10195', '201303050000'),
(98, 'এর কারণ, আমার এ-লেভেল ফাইনাল পরীক্ষার ঠিক আগ মুহূর্তে আমি এই রিয়েলিটি শোটি উপস্থাপনা করার প্রস্তাব পাই ।  যেখানে আমি পরীক্ষার জন্য নাটকের কাজ বন্ধ করে দিয়েছিলাম, সেখানে এই অনুষ্ঠানটি আমাকে পরীক্ষার আগে কাজে ফেরাতে পারবে না বলেই আমি সিদ্ধান্ত নিয়েছিলাম ।  কিন্তু আমার মা আমাকে অনেক করে বোঝালেন, আমি যেন এই উপস্থাপনাটি করি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/05/10196', '201303050000'),
(99, 'প্রায় আট মাস ধরে এই অনুষ্ঠানটির উপস্থাপনা করছেন তিনি ।  এরই মধ্যে অনুষ্ঠানটি দর্শকপ্রিয় হয়ে উঠছে ।  প্রতি শুক্রবার রাত ৯টায় অনুষ্ঠানটি প্রচার হয় ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/05/10198', '201303050000'),
(100, 'ইকবাল হোসাইন চৌধুরীর রচনা ও চিত্রনাট্য এবং আতিক জামানের পরিচালনায় এ ধারাবাহিকের গল্পে দেখা যাবে ইউনিভার্সিটি পড়ুয়া বিচিত্র সব চরিত্র মিলে বন্ধু-বান্ধবদের একটা দল ।  এই দলে আছে লরা ।  সে যেমন সুন্দরী, তেমনি দুরন্ত ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/05/10200', '201303050000'),
(101, '১৩ ভাগ মেয়েরা ।  বাকি ১৭ ভাগ যাদের প্রেমিক-প্রেমিকা নেই তারা!  একটি প্রেমের সম্পর্কে ছেলে যে অর্থ ব্যয় করে, মেয়েরা তার ১০ ভাগের এক ভাগও করে না । ', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/18/10079', '201302180000'),
(102, 'এক ঢিলে দুই পাখি মারতে পারবা । প্রেমও করবে টাকাও পাবে ।  চলে যাও তাওবাও কোম্পানির সঙ্গে যোগাযোগ করো ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/18/10081', '201302180000'),
(103, 'গুরুর কথা শুনেই নিজের ভাবনার রাজ্য উলট পালট করে ফেললেন মোশাররফ করিম ।  অভিনয় দিয়েই এখন তিনি নিজের জনপ্রিয়তার গল্প রচনা করেছেন ।  কোনো নাটকে তার উপস্থিতি মানেই যেন সেই নাটকের প্রতি দর্শকদের বাড়তি একটি আগ্রহ তৈরি হয়ে যাওয়া ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9753', '201301100000'),
(104, 'এই অরিন রুপালি পর্দার ঝলমলে জগতে হাঁটতে চান ।  এই অরিন বাস্তবতাকে অস্বীকার করে যে বাণিজ্যিক ছবির দুনিয়া, সেখানে হারিয়ে যেতে চায় ।  তবে লাক্স-চ্যানেলআই প্রতিযোগিতায়ই বা নাম লেখানো কেন?', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9754', '201301100000'),
(105, 'সাক্ষাত্কার নিয়েছেন আর হোসেন প্রাপ্তির গল্প দিয়েই আলোচনা শুরু হোক ।  গেল বছরে আরটিভির প্রাপ্তিগুলো কী ছিল? আলহামদুলিল্লাহ ।  আসলে প্রাপ্তির শেষ নেই ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9755', '201301100000'),
(106, 'যেসব ওয়েবসাইটে আপনি ইউজার নেম ও পাসওয়ার্ড ব্যবহার করে ঢুকেন, স্পাইওয়্যার সেসবের পাসওয়ার্ড সংগ্রহ করে সেগুলো ওয়েবসাইটে আপনার তথ্য ঝুঁকির মধ্যে ফেলে দিতে পারে ।  স্পাইওয়্যার পিসির পারফরমেন্স খারাপ করে দিতে পারে ।  স্পাইওয়্যার থেকে বাঁচার জন্য ভালো অ্যান্টিভাইরাস ব্যবহার করতে হবে ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/03/10188', '201303030000'),
(107, 'কারণ সে গানে না ছিল ছোট পোশাকের বাহুল্য, আর না ছিল সোনাক্ষি কেন্দ্রিকতা ।  যেখানে প্রভু দেবার মতো একজন নৃত্যশিল্পী পর্দা কাঁপাচ্ছেন, সেখানে সোনাক্ষির উপস্থিতি খানিকটা হলেও তো লঘু হয়েই যায় ।  তাই গানটিতে বেশ চপল পায়ে নেচে প্রশংসা কুড়োলেও আইটেমের জন্য একটা ছটফটানি তাঁর ছিলই ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9758', '201301100000'),
(108, 'নবায়নযোগ্য জ্বালানি মাত্র ২০ শতাংশ সরবরাহ করবে ।  এই যোজনা সম্পূর্ণ নতুন করে ভেবে দেখা উচিত । পদত্যাগ করার স্বল্প আগে কান নবায়নযোগ্য জ্বালানির ব্যবহার বাড়ানো সংক্রান্ত আইনটি পাস করান ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/03/10191', '201303030000'),
(109, 'এখানে রেডিমেট শার্টের দাম পড়বে ৮০০ থেকে ১ হাজার ২০০ টাকা ।  শার্ট তৈরি করতে লাগবে ৩০০ টাকা ।  তরুণদের জন্য শার্ট গ্যালারিতে রয়েছে ট্রেন্ডি শার্টের কালেকশন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/27/10372', '201303270000'),
(110, 'ছবির নাম ‘ভালোবাসা আজকাল’ ।  ছবিটি পরিচালনা করবেন পি এ কাজল ।  এতে শাকিবের বিপরীতে অভিনয় করবেন ‘ভালোবাসার রঙ’ চলচ্চিত্র খ্যাত নায়িকা মাহি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/18/10071', '201302180000'),
(111, 'এর আনুষ্ঠানিক উদ্বোধন করেন বাংলাদেশ ইউনিভার্সিটির বোর্ড অব ট্রাস্টিজের প্রেসিডেন্ট কাজী জামিল আজহার ।  প্রতিযোগিতায় প্রধান বিচারকের দায়িত্ব পালন করেন বাংলদেশ প্রকৌশল বিশ্ববিদ্যালেয়র কম্পিউটার বিজ্ঞান বিভাগের অধ্যাপক ড. মোহাম্মদ কায়কোবাদ ।  ওইদিন সন্ধায় সমাপনী অনুষ্ঠানে বিজয়ীদের মধ্যে পুরস্কার বিতরণ করেন এশিয়া প্যাসিফিক ইউনিভার্সিটির উপাচার্য প্রফেসর ড. জামিলুর রেজা চৌধুরী ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9749', '201301100000'),
(112, 'যারা দীর্ঘমেয়াদে অনলাইন ফ্রিল্যান্সিংয়ে ক্যারিয়ার গড়তে চান তাদের জন্য পরামর্শ হলো, ওয়েব ডিজাইন ও ডেভেলপমেন্ট ভালো করে শিখুন ।  শেখার জন্য প্রথমেই এইটিএমএল, সিএসএস, জাভাস্ক্রিপ্ট শিখুন ।  অতঃপর পিএইচপি শিখুন ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9750', '201301100000'),
(113, 'তাই চোখকে রোদের তীব্রতা থেকে দূরে রাখতে পারতে পারেন সানগ্লাস বা রোদচশমা ব্যবহার করে ।  এখন সময় ফ্যাশনের ।  ফ্যাশনের সঙ্গে তাল মিলিয়ে চলাটা এখনকার আধুনিকতা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/03/10181', '201303030000'),
(114, 'সেটা গেল বিশ্বকাপের কথা ।  তখন টিম ইন্ডিয়া ঢাকায় অবস্থান করছে ।  ডিনারের সময় যুবির সঙ্গে গল্প করতে গিয়ে শচীন বুঝতে পেরেছিলেন যে, সে পুরোপুরি সুস্থ নয় ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/27/10365', '201303270000'),
(115, 'গত ডিসেম্বরে আন্তর্জাতিক ক্রিকেট থেকে অবসর নেন পন্টিং ।  সিপিএল ছাড়াও ইন্ডিয়ান প্রিমিয়ার লিগ  মাতাবেন তিনি ।  প্রতিযোগিতার ষষ্ঠ আসরে আইপিএলের দল মুম্বাই ইন্ডিয়ান্সের অধিনায়ক হিসেবে দেখা যাবে তাকে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/27/10367', '201303270000'),
(116, 'বল খরচের হিসেবটা দেখলেই বোঝা যাবে অস্ট্রেলিয়ার বিশ্বমানের বোলারদের তিনি কতটা নির্দয়ভাবে শাসন করেছেন ।  মাত্র ১৭৪ বল খরচ করতে হয়েছে ১৮৭ রান সংগ্রহ করার জন্য ।  ৩৩টি বাউন্ডারি আর দুই ছক্কা হাঁকিয়েছেন এই ব্যাটসম্যান ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/27/10368', '201303270000'),
(117, 'এবার তিনি সামাজিক যোগাযোগ মাধ্যমের সবচেয়ে জনপ্রিয় ক্রিকেটার নির্বাচিত হয়েছেন ।  আমেরিকান বহুজাতিক প্রযুক্তি ও পরামর্শদাতা প্রতিষ্ঠান আইবিএমের একটি বিশ্লেষণে এ তথ্য উঠে এসেছে ।  অস্ট্রেলিয়ার বিরুদ্ধে চলমান সিরিজে ভারত এরই মধ্যে চার ম্যাচের মধ্যে তিনটিতে জয়লাভ করে সিরিজ নিশ্চিত করেছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/27/10369', '201303270000'),
(118, 'মিসর ও নেদারল্যান্ডসে ফুটবল মাঠে হত্যার ঘটনা এবং ইউরোপজুড়ে বর্ণবাদী বৈষম্যের তীব্রতা দুশ্চিন্তা বাড়িয়ে দিয়েছে ।  ফুটবলে নতুন প্রযুক্তির ব্যবহারও হয়েছে এ বছর ।  ঊনবিংশ শতাব্দী থেকে চলে আসা প্রথাগত প্রযুক্তিকে সরিয়ে দিয়ে ২১ শতকে জায়গা করে নিয়েছে আধুনিক গোললাইন প্রযুক্তি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9736', '201301100000'),
(119, 'এর মধ্যে অধিকাংশ গ্রন্থের একটি বিশাল অংশ জুড়ে আছে সাঁইজীর জন্মস্থান ও পৈতৃক ধর্ম নিয়ে অহেতুক বিতর্ক ।  লালন সাঁইজী যে বিষয়ে তাঁর কোনো রচনায় সামান্যতম ইঙ্গিত পর্যন্ত দিয়ে যাননি, তা নিয়েই এত বিস্তর টানা-হেঁচড়া দেখে অবাক হতে হয় ।  লালন সাঁইজীর রচনা বলতে আমি তাঁর গানের কথাই বলছি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/27/10348', '201303270000'),
(120, 'আর এ কারণেই ছবিটিতে কাজের প্রতি আমি আগ্রহী হয়ে উঠি ।  আমার বিশ্বাস, বিপ্লব ভাই অনেক যত্ন নিয়েই ছবিটি নির্মাণ করবেন ।  আমিও চেষ্টা করব আমার চরিত্রটি যথাযথভাবে ফুটিয়ে তুলতে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/24/10135', '201302240000'),
(121, 'প্রকৃতপক্ষে ইন্টারনেট সেবাকে জনপ্রিয় করতে মোবাইল ফোনই বিশেষ ভূমিকা পালন করছে ।  ব্রডব্যান্ড ইন্টারনেটের পাশাপাশি ওয়াইম্যাক্স ইন্টারনেট সেবাও জনপ্রিয় হচ্ছে ।  বর্তমানে দেশে ২.৫ লাখের মত ওয়াইম্যাক্স ইন্টারনেট ব্যবহারকারী রয়েছে ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/24/10122', '201302240000'),
(122, 'যোগাযোগমন্ত্রী ওবায়দুল কাদের অনুষ্ঠানে প্রধান অতিথি ছিলেন ।  অনুষ্ঠানে বিশেষ অতিথি ছিলেন গুগলের দক্ষিণ-পূর্ব এশীয় অঞ্চলের পলিসি অ্যান্ড গভর্নমেন্ট অ্যাফেয়ার্স বিভাগের প্রধান অ্যান লেভিন ।  অনুষ্ঠানে বক্তব্য রাখেন পর্যটন ও বেসামরিক বিমান চলাচল সচিব খোরশেদ আলম চৌধুরী এবং তথ্য ও যোগাযোগ প্রযুক্তি মন্ত্রণালয়ের সচিব নজরুল ইসলাম খান ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/24/10123', '201302240000'),
(123, 'পরে ইঞ্জিনচালিত নৌকায় ফায়ার সার্ভিসের কর্মীরা যেতে পারলেও ততক্ষণে ২৫টি ঘর পুড়ে যায় ।  এতে প্রায় কোটি টাকার ক্ষয়ক্ষতি হয়েছে বলে ফায়ার সার্ভিস সূত্রে জানা গেছে ।  এদিকে নড়াইলের নাকশী বাজারে শুক্রবার রাতে অগ্নিকান্ডে আটটি দোকান ভস্মীভূত হয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/latestnews/2013/02/23/3237', '201302230000'),
(124, 'এ পরিসংখ্যান অনুযায়ী বোঝা যাচ্ছে, ইন্টারনেটে মোবাইলের বাজার বেশ বৃহত্ ।  বিক্রয় ডট কমে সেকেন্ড হ্যান্ড মোবাইলের লেনদেন দেশব্যাপী ৮২ ভাগ বৃদ্ধি পেয়েছে বলে জানা গেছে ।  বাংলাদেশে সেকেন্ড হ্যান্ড মোবাইল বিক্রয়ের প্রধান শহরগুলো হচ্ছে ঢাকা, চট্টগ্রাম, খুলনা এবং রাজশাহী ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/24/10124', '201302240000'),
(125, 'আবার কেউ কেউ লেখকদের সঙ্গে মুনাফা ভাগ করে নেন ।  আপনি ওইসব সাইটে বিভিন্ন নিবন্ধ লিখতে পারেন ।  যার লেখা যত বেশি পাঠক পড়বেন, তিনি তত বেশি অর্থ পাবেন ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/24/10125', '201302240000'),
(126, 'প্রথম পর্বে চার ম্যাচে জয় ও একটিতে ড্র করে ১৩ সংগ্রহ করেছিল তারা ।  কিন্তু দ্বিতীয় রাউন্ডে এখনও জয়ের মুখ দেখেনি সাদা-কালোরা ।  ব্রাদার্সের কাছে ৪-১ গোলে হারের পর গতকাল মোহামেডানকে পয়েন্ট হারাতে হয়েছে শেখ জামালের কাছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/02/06/22590', '201302060000'),
(127, 'পুরুষদের পাশাপাশি মহিলা টি-টোয়েন্টি বিশ্বকাপের আয়োজকও ঢাকা ।  এ ইভেন্টের লঞ্চিং হবে চলতি বছরের ৬ এপ্রিল থেকে ।  বিশ্বকাপের সম্ভাব্য ভেন্যু মিরপুর, সিলেট স্টেডিয়াম, ফতুল্লা, চট্টগ্রামের জহুর আহমেদ চৌধুরী স্টেডিয়াম; বিকেএসপিও বিবেচনায় আছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/03/07/23039', '201303070000'),
(128, 'ড.সনজীদা খাতুন থেকে শুরু করে খায়রুল আনাম শাকিল এ দেশের বহু খ্যাতনামা কণ্ঠশিল্পীর ওস্তাদ তিনি ।  কত গান তিনি স্বকণ্ঠে পরিবেশন করেছেন, সে পরিসংখ্যান কেউ সঠিকভাবে পরিবেশন করতে পারেননি ।  ইন্তেকালের প্রায় এক দশক আগে থেকেই তিনি অসুস্থ ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/10/9727', '201301100000'),
(129, 'বিশেষ করে, রাষ্ট্রায়ত্ত ব্যাংকের দুর্নীতি অতীতের যে কোনো সময়কে ছাড়িয়ে গেছে ।  বাংলাদেশ ব্যাংকের তথ্য অনুযায়ীই দেখা যায়, ২০০৯ থেকে এ পর্যন্ত গত চার বছরে দেশের বাণিজ্যিক ব্যাংকগুলোতে আর্থিক অনিয়ম ১০ হাজার কোটি টাকা ছাড়িয়ে গেছে ।  এর মধ্যে রাষ্ট্রায়ত্ত সোনালী, জনতা, অগ্রণী, রূপালী, কৃষি ও বেসিক ব্যাংকে অনিয়মের ঘটনাই ৭ হাজার কোটি টাকার বেশি ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184644', '201301250000'),
(130, 'সম্প্রতি এ গানটির রেকর্ডিং শেষ হয়েছে রুমির নিজস্ব স্টুডিওতে ।  ‘গেম’ চলচ্চিত্রের একটি গান এটি ।  ‘জাদু’ শিরোনামের গানটির কথা লিখেছেন জাহিদ আকবর ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/01/21/22353', '201301210000'),
(131, 'আমি আশাবাদী শিল্প চর্চার মাধ্যমে তারা সবাই ভবিষ্যতে দেশ গড়ায়... সংস্কৃতি প্রতিবেদক জাবি নাট্যোত্সবে ‘ত্রিংশ শতাব্দী’ ‘প্রদীপশিখা জ্বলবে আরও ঘোঁচাতে অন্ধকার’—এ স্লোগানে জাহাঙ্গীরনগর থিয়েটার আয়োজিত চলমান সপ্তাহব্যাপী নাট্যোত্সবে নাট্যপ্রদর্শনীর শেষ দিনে আগামী ৭ ফেব্রুয়ারি ২০১৩ বৃহস্পতিবার সন্ধ্যা সাড়ে ছয়টায় জাহাঙ্গীরনগর বিশ্ববিদ্যালয়ের সেলিম আলদীন মুক্তমঞ্চে স্বপ্নদলের যুদ্ধবিরোধী গবেষণাগার প্রযোজনা ‘ত্রিংশ... সংস্কৃতি প্রতিবেদক প্র দ র্শ নী : বাতাসে ভাসমান ভালোবাসা ভালোবাসাকে উপজীব্য করে চিত্রপট সাজিয়েছেন একঝাঁক শিল্পী ।  রং আর রেখায় নানা আঙ্গিকে ক্যানভাসে হৃদয়ের কথা বলেছেন ২৭ শিল্পী দম্পতি ।  একটি ভাস্কর্যসহ ছাপচিত্র, তেলরং, জলরং, অ্যাক্রলিক, কাঠ খোদাই ও মিশ্র মাধ্যমে আঁকা হয়েছে প্রায় আশিটি ছবি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/02/06/22597', '201302060000'),
(132, 'এর আগের তিন ম্যাচেই হেরেছে খুলনা ।  রাজাশাহী এক ম্যাচ জিতলেও হেরেছে বাকি দুটিতে ।  খুলনার শেখ আবু নাসের স্টেডিয়ামে টস হেরে আগে ব্যাট করতে নামা খুলনা রয়্যালস শাহরিয়ার নাফীসের অপরাজিত শতকের সৌজন্যে কোনো উইকেট না হারিয়ে ১৯৭ রান করে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184636', '201301250000'),
(133, 'দ্বিতীয় লেগের খেলায় ভ্যালেন্সিয়ার মাঠে ১-১ গোলে ড্র করে রিয়াল ।  খেলার ১৩ মিনিটে বল ঠেকাতে গিয়ে হাতে চোট পান ক্যাসিয়াস ।  পাঁচ মিনিট পর হাতের ব্যথা নিয়ে মাঠ ছাড়তে হয় রিয়ালের এ গোলকিপারকে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184632', '201301250000'),
(134, 'ধারণা করা হচ্ছে, বাবা চন্দরপলের মতো ব্যাট হাতে রানের ফুলঝুরি ছড়াবেন তাজেনারাইন ।  ১৮ বছর বয়সে চন্দরপলও প্রথম শ্রেণীর ক্রিকেটে অভিষেক ম্যাচ খেলেছিলেন গায়ানার হয়ে ।  বর্তমানে চন্দরপল বাংলাদেশ প্রিমিয়ার লিগে খেলছেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184640', '201301250000'),
(135, '১৯৯১ সালের মাঝামাঝি সময়ে ভারত নিদারুণ অর্থনৈতিক ও রাজনৈতিক বিপর্যয়ের মধ্যে পড়েছিল ।  সে বছর মে মাসে ভারতের সাবেক প্রধানমন্ত্রী ও পার্লামেন্টে বিরোধী দলীয় নেতা রাজীব গান্ধী এক আত্মঘাতী বোমা হামলাকারীর হামলায় নিহত হন ।  ওই সময় তিনি ভারতের দক্ষিণাঞ্চলে নির্বাচনী প্রচার অভিযানে ব্যস্ত ছিলেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189159', '201302230000'),
(136, 'শত শত বন্ধুর সঙ্গে যোগাযোগ করে চলেছেন প্রতিনিয়ত ।  একদিন ফেসবুকে না ঢুকলে ভালো লাগে না ।  তবে আশঙ্কার বিষয় হলো, ফেসবুক যে কোনো সময় বিনা নোটিশে আপনার এই শখের অ্যাকাউন্টটি বন্ধ করে দিতে পারে ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/01/25/1130', '201301250000'),
(137, 'কতিপয় অসাধু ব্যবসায়ী চটকদার নাম ও মোড়কে ভেজাল এবং নিম্নমানের বীজ বাজারজাত করছে ।  বিএডিসির বিরুদ্ধেও ভেজাল ও নিম্নমানের বীজ সরবরাহের অভিযোগ রয়েছে ।  এসব বীজ বপন করে কাঙ্ক্ষিত ফসল পাচ্ছেন না চাষীরা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189189', '201302230000'),
(138, 'তবে বিএডিসি যে বীজ বিক্রি করে, তা সার্টিফাইড বীজ ।  এগুলো উন্নতমানের বীজ ।  সমস্যা একটাই বীজ উত্পাদন এতই কম, যেজন্য অল্পসংখ্যক কৃষককে বীজ দেয়া সম্ভব হচ্ছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189191', '201302230000'),
(139, 'এর মধ্যে রেকর্ড ১৮ ম্যাচে জয় আর এক ম্যাচে পয়েন্ট ভাগ করে মাঠ ছেড়েছে স্প্যানিশ লিগের জায়ান্ট এ দলটি ।  অবশেষে অপ্রতিরোধ্য বার্সার জয়ের লাগাম টেনে ধরেছে রিয়াল সোসিয়েদাদ ।  শনিবার রাতে স্প্যানিশ লিগে তাদেরকে ২-৩ গোলে পরাস্ত করে সোসিয়েদাদ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183961', '201301210000'),
(140, 'লাভজনক হওয়ায় দিন দিন বাড়ছে গোলাপ চাষীর সংখ্যা ।  দুই শতাধিক ফুল চাষী এখন গোলাপ ফুল চাষ করে হয়েছেন স্বাবলম্বী ।  পাশাপাশি দেশের বিভিন্ন স্থানে তা সরবরাহ করে বয়ে এনেছেন সাভারের সুনাম ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189192', '201302230000'),
(141, 'ফলে একদিনের জন্য হলেও পাকিস্তান সফরে গিয়ে বাংলাদেশ সে দেশের ক্রিকেটার নিয়ে আসার উদ্যোগ নেবে ।  পিসিবির এই ধারণা ভুল প্রমাণিত হয়েছে বলে মনে করেন বিসিবি সভাপতি নাজমুল হাসান ।  কারণ বিপিএলে ইংল্যান্ড, অস্ট্রেলিয়া, আয়ারল্যান্ড, জিম্বাবুয়ে ও আফগানিস্তানের নামি-দামি ক্রিকেটাররা অংশগ্রহণ করেছেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183963', '201301210000'),
(142, 'এদিন বৈরী আবহাওয়া ছিল ম্যাচের ‘খলনায়ক’ ।  আগে ব্যাট করা স্বাগতিকরা পুরো ৫০ ওভার ব্যাট করে ৯ উইকেট হারিয়ে ২২২ রান সংগ্রহ করেছিল ।  কিন্তু বিপত্তি বাধে লঙ্কান ইনিংসের সময় ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183964', '201301210000');
INSERT INTO `pos_data_table` (`id`, `content`, `category`, `domain`, `url`, `date`) VALUES
(143, 'কিন্তু এ খুশি যে কাল হয়ে দাঁড়িয়েছে তাদের কপালে ।  কারণ এ ফলের সঠিক প্রক্রিয়াজাতকরণ এবং বিপণন পদ্ধতি জানা নেই অত্র এলাকার কৃষকদের ।  এদিকে গাছ লাগানোর এক বছর পর গ্রিন বাংলাদেশ নামক কোম্পানির প্রতিনিধিরাও উধাও হয়ে যায় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189194', '201302230000'),
(144, 'গতকাল বোর্ড মিটিং শেষে ডেপুটি গভর্নর এস কে সুর চৌধুরী সাংবাদিকদের বলেন, বোর্ড মিটিংয়ে দুটি এনআরবি ব্যাংক এবং চারটি প্রচলিত ধারার ব্যাংকের মেমো উপস্থাপন করেছিলাম ।  এদের মধ্যে পাঁচটি ব্যাংকের চূড়ান্ত লাইসেন্স দেয়া হয়েছে ।  তবে বোর্ড মিডল্যান্ড ব্যাংকের উপস্থাপিত ব্যবসায়িক পরিকল্পনার বিষয়ে আরও পরিষ্কার হতে চেয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186604', '201302060000'),
(145, 'দলীয় ৩৬ রানে অপর ওপেনিং ব্যাটসম্যান শামসুর রহমান পেসার ফরহাদ রেজার বলে সরাসরি বোল্ড হলে দ্বিতীয় উইকেট হারায় সেন্ট্রাল ।  এমন বিপর্যয়ের মুখে ৩ নম্বরে ব্যাট করতে নেমে দলকে একাই এগিয়ে নিতে থাকেন রকিবুল হাসান ।  রকিবুল উইকেটের এক প্রান্ত আগলে রাখলেও অপর প্রান্ত আগলে রাখতে ব্যর্থ হন পরের সারির ব্যাটসম্যানরা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189177', '201302230000'),
(146, '১ মার্চ সড়ক দুর্ঘটনার শিকার হয়ে আহমদ জামান চৌধুরী গুরুতর অসুস্থ ছিলেন ।  মৃত্যুকালে তার বয়স হয়েছিল ৬৭ বছর ।  তিনি ছিলেন চিরকুমার ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190913', '201303070000'),
(147, 'চোটের খড়গে আছেন অধিনায়ক মুশফিক ও রিয়াদ ।  সব মিলিয়ে গতকাল প্রাথমিক স্কোয়াডের অনুশীলনের দ্বিতীয় দিন ৮ জনকে হাতে পেয়েছেন প্রধান কোচ শেন জার্গেনসেন ।  বিসিএলের ফাইনাল ছিল দুপুরে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189180', '201302230000'),
(148, 'বিভিন্ন দেশে ক্রিকেট ছড়িয়ে দিতে বিশেষ করে ক্রিকেটের উদীয়মান দেশগুলোতে এবং আমেরিকা, চীন, এমনকি ইউরোপীয় বিভিন্ন দেশে এটা ছড়িয়ে দেয়া যেতে পারে ।  ক্রিকেটকে বিশ্বায়নের জন্য এ ফরম্যাট সম্ভবত আপনার খুবই প্রয়োজন বলে আমি মনে করি ।  আমি এখনও বিশ্বাস করি—ক্রিকেটের রাজা টেস্ট ক্রিকেট; কেননা একজন ক্রিকেটারের স্বীকৃতি মেলে টেস্ট পারফরমেন্সের ভিত্তিতে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189183', '201302230000'),
(149, 'সহজেই বোঝা যায়, এদের মধ্যে সিনিয়র হলেন কিছলু ভাই ।  ওরা ব্যাচেলর, দ্বারে দ্বারে ঘুরে বাসা খোঁজে ।  বাসা পাওয়ায় সবচেয়ে বড় অবদান রাখেন কিছলু ভাই ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/184051', '201301210000'),
(150, 'কিন্তু তারপরও বিরাম নেই ।  ফটো সাংবাদিকদের অনুরোধে একের পর এক পোজ দিয়ে যাচ্ছেন ফারহানা নিশো, সারিকা ও সুজানা ।  কখনও সলো, কখনও ডুয়েট, আবার কখনও তিন কন্যার এক ছবি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/01/21/1124', '201301210000'),
(151, 'অপরদিকে গ্রুপের শেষ ম্যাচে গতকাল সন্ধ্যা ৭টায় স্বাগতিক নেপাল মুখোমুখি হয়েছিল শক্তিশালী প্যালেস্টাইনের ।  ম্যাচটি গোলশূন্য ড্র হওয়ায় ৭ পয়েন্ট নিয়ে গ্রুপ চ্যাম্পিয়ন হিসেবে চূড়ান্তপর্ব নিশ্চিত করেছে প্যালেস্টাইন ।  আর তিন ম্যাচে নেপালের সংগ্রহ মাত্র ৪ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190871', '201303070000'),
(152, 'তিনি আমাকে চিনতে পারছেন না ।  তার অবস্থা অবনতির দিকে ।  খুবই অসুস্থ তিনি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186566', '201302060000'),
(153, 'প্রথম লেগের ম্যাচে ১-১ গোলে ড্র করেছিল দু’দল ।  মঙ্গলবার রাতে বিশ্বের অন্যতম সেরা দুই ক্লাব রিয়াল-ম্যানইউর ফুটবল লড়াই দেখতে ওল্ড ট্রাফোর্ডের দিকে চোখ ছিল কোটি ফুটবলপ্রেমীর ।  ক্রিশ্চিয়ানো রোনালদোর দিকেও আলাদা নজর ছিল দর্শক সমর্থকদের ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190873', '201303070000'),
(154, 'তার গোলের কারণেই চ্যাম্পিয়ন্স লিগের শেষ ষোল থেকে বিদায় নিতে হলো ম্যানইউকে ।  তবে গোল করে তা উদযাপন করেনি পর্তুগিজ এই উইঙ্গার ।  কারণ হয়তো তার মনে পড়ে গেছে এক সময় ম্যানইউর সমর্থকদের, তার নামে জয়োধ্বনি দেয়ার মুহূর্তগুলো ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190875', '201303070000'),
(155, 'যে কারণে বিরতিহীনভাবে নতুন নতুন গল্পের চলচ্চিত্রে কেন্দ্রীয় চরিত্রে অভিনয় করছেন তিনি ।  হিসাব কষে খুব সহজেই বলা যায়, চলতি বছরটা থাকবে ইমনেরই দখলে ।  তাকে নিয়ে লিখেছেন মাদিহা মাহনূর মনের গহিনে... হিমুর হিমেল হাওয়া ‘ঘরকুটুম’ নাটকে হোমায়রা হিমুর বিপরীতে অভিনয় করেছিলেন সালাহউদ্দিন লাভলু ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/02/23/1160', '201302230000'),
(156, 'কোচ লুইস ফিলিপ স্কোলারির বিবেচনায় কাকা প্রাথমিক দলে না থাকলেও শেষ পর্যন্ত রিয়াল মাদ্রিদের এই প্লে-মেকার মঙ্গলবারের ঘোষিত খেলোয়াড়দের তালিকায় জায়গা করে নিয়েছেন ।  অপরদিকে ফেব্রুয়ারিতে ইংল্যান্ডের বিপক্ষে ব্রাজিলের দুঃখজনক হারের ম্যাচে রোনালদিনহোর বাজে পারফরমেন্স তাকে স্কোয়াডের বাইরে ঠেলে দিয়েছে ।  স্কোলারির দলে জায়গা ধরে রেখেছেন নেইমার, অস্কার ও লুকাস ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190880', '201303070000'),
(157, 'বিশেষ ধরনের ক্যামেরাসংবলিত এ গাড়ি দেশের বিভিন্ন স্থানের ছবি তুলবে ও গুগল ম্যাপে এর অবস্থান তুলে ধরবে ।  গত শনিবার রাজধানীর একটি হোটেলে এ গাড়ির আনুষ্ঠানিক যাত্রা শুরু হয় ।  দেশে গুগলের এ কার্যক্রমে সহায়তা দিচ্ছে বাংলাদেশ ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/02/23/1159', '201302230000'),
(158, 'শান্তির প্রতীক হিসেবে সেসব তরুণের মুষ্টিবদ্ধ হাতে উড়ছে একখণ্ড সাদা কাপড় ।  তেলরঙ ব্যবহার করে ছবিটি এঁকেছেন মোকাররম হোসেন ।  প্রদর্শনীতে ‘কর্মকার’ শীর্ষক চিত্রকর্মে উদ্ভাসিত হয়েছে শ্রমজীবী মানুষের কথা ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190883', '201303070000'),
(159, 'পরিচালনার পাশাপাশি তিনি এই ধারাবাহিকে অত্যন্ত গুরুত্বপূর্ণ একটি চরিত্রে কাজ করছেন ।  এ নাটকে মফস্বলের একজন সাংবাদিকের ভূমিকায় কাজ করছেন তিনি ।  এতে শুধু জাহিদ হাসানের অভিনয়ই নয়, পুরো নাটকের বিষয়বস্তু এরই মধ্যে দর্শকদের আকর্ষণ করতে সক্ষম হয়েছে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186633', '201302060000'),
(160, 'বাংলাদেশ পেট্রল পাম্প ও ট্যাংক-লরি মালিক শ্রমিক ঐক্য পরিষদ তাদের দাবি আদায় না হওয়া পর্যন্ত ধর্মঘট চালিয়ে যাবে বলে এক প্রেস বিজ্ঞপ্তিতে জানিয়েছে ।  সারাদেশে শান্তিপূর্ণভাবে এ ধর্মঘট চলছে বলেও জানা পেট্রল পাম্প ওনার্স অ্যাসোসিয়েশনের মহাসচিব মো. হারুন উর রশিদ ।  গতকাল রাজধানীর বিভিন্ন এলাকা ঘুরে দেখা যায়, অনেক গাড়ির মালিক ধর্মঘট শুরুর আগেই অতিরিক্ত তেল সংগ্রহ করায় কিছুটা কম সমস্যার সম্মুখীন হয়েছেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/184043', '201301210000'),
(161, 'বর্তমান সরকার ক্ষমতায় আসার পর এ পর্যন্ত ছয়বার বেড়েছে পরিবহন ভাড়া ।  যোগাযোগমন্ত্রী ওবায়দুল কাদের ভাড়া বৃদ্ধির এ সিদ্ধান্ত গতকাল সাংবাদিকদের জানান ।  আজ থেকে নতুন এ ভাড়া কার্যকর হবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/184044', '201301210000'),
(162, 'পোর্ট এলিজাবেথে সিরিজের দ্বিতীয় ও শেষ টেস্টে দক্ষিণ আফ্রিকার কাছে ইনিংস এবং ১৯৩ রানের বিশাল ব্যবধানে হারল সফরকারী নিউজিল্যান্ড ।  এই জয়ে দুই ম্যাচ টেস্ট সিরিজে নিউজিল্যান্ডকে ২-০ ব্যবধানে হোয়াইটওয়াশ করেছে প্রোটিয়ারা ।  প্রথম টেস্টেও দক্ষিণ আফ্রিকার কাছে ইনিংস ও ২৭ রানে হেরেছিল নিউজিল্যান্ড ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182883', '201301150000'),
(163, 'দলের অন্যান্য তারকা অনুশীলনে উপস্থিত থাকলেও সবার দৃষ্টি ছিল সাকিবের দিকেই ।  দীর্ঘদিন পর মাঠে ক্রিকেটে ফিরছেন তিনি ।  ওয়েস্ট ইন্ডিজের বিপক্ষে খুলনায় দ্বিতীয় টেস্টের দ্বিতীয় ইনিংসে ৯৭ রানে আউট হওয়ার পর আর মাঠে ফেরেননি সাকিব ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182888', '201301150000'),
(164, 'পক্ষান্তরে আট ম্যাচ থেকে ছয় জয় ও দুই হারসহ ১২ পয়েন্ট নিয়ে এখন পর্যন্ত তালিকায় শক্ত অবস্থানে রয়েছেন সিলেট রয়্যালস ।  চলতি টুর্নামেন্টে এটি সিলেটের দ্বিতীয় হার ।  এর আগে চট্টগ্রামে ঢাকা গ্ল্যাডিয়েটর্সের বিপক্ষে ৩১ রানে হেরেছিল মুশফিক বাহিনী ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186561', '201302060000'),
(165, 'কাতারের দোহার খলিফা ইন্টারন্যাশনাল স্টেডিয়ামে এ দুই চ্যাম্পিয়নের ম্যাচটি বাড়তি উত্তাপ ছড়াবে ।  প্রীতি ম্যাচ হলেও জয় পেতে দু’দলই মরিয়া ।  তবে স্পেন কোচ ভিসেন্তে দেল বস্কের দলটি কিছুটা অগোছালো ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186563', '201302060000'),
(166, 'নতুন দুটি সূচক চালু হলে ডিএসআই সূচকটি বাদ দেয়া হবে ।  তবে নতুন সূচক দুটি চালু হলেও সাধারণ বিনিয়োগকারীদের সুবিধার্থে ডিএসই সাধারণ সূচকও ক’মাস পর্যন্ত চালু থাকবে ।  এ বিষয়ে ডিএসইর সিনিয়র ভাইস প্রেসিডেন্ট আহমেদ রশীদ লালী জানান, নতুন দুটি সূচক চালুর বিষয়ে ডিএসইর বোর্ড সভায় সিদ্ধান্ত নেয়া হয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184724', '201301250000'),
(167, 'আর বৈদেশিক উত্স থেকে ব্যয় হয়েছে নেয়া প্রকল্প সাহায্য থেকে ব্যয় হয়েছে ৫ হাজার ৭৪৮ কোটি টাকা ।  পরিকল্পনা মন্ত্রণালয়ের বাস্তবায়ন, পরীবিক্ষণ ও মূল্যায়ন বিভাগের (আইএমইডি) প্রতিবেদন সূত্রে এসব তথ্য জানা গেছে ।  অর্থবছরের অর্ধেক সময় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184725', '201301250000'),
(168, 'বিশাল ব্যয়ের এ প্রকল্প থেকে বিদ্যুত্ উত্পাদন হবে মাত্র ছয় মেগাওয়াট ।  এর মধ্যে জাতীয় গ্রিডে চার মেগাওয়াট বিদ্যুত্ যোগ হবে ।  তবে শেষ পর্যন্ত প্রকল্পটির ব্যয় কমিয়ে ৭৩ কোটি ৪৭ লাখ টাকা বরাদ্দ দেয়া হচ্ছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183994', '201301210000'),
(169, 'এই বেলজিয়ামের রাজধানী ব্রাসেলসে জন্মগ্রহণ করেন তিনি ।  ছেলেবেলা থেকেই ছবি আঁকার প্রতি ঝোঁক ছিলো হার্জের ।  তিনি যখন দুষ্টুমি করতেন, তার বাবা-মা তখন তাকে ছবি আঁকতে বসিয়ে দিতেন ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190837', '201303070000'),
(170, 'এলসিডি টিভির তুলনায় এই নতুন সিরিজের এলইডি টিভিগুলোতে রয়েছে ৫ থেকে ১০ ভাগ বেশি রঙের পরিসর ।  এলইডি ব্যাকলাইট নিভে গিয়ে রঙের পরিসর আরও বৃদ্ধি করে ।  আর ফলস্বরূপ আরও সমৃদ্ধ পিকচার সৃষ্টি হয় ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185254', '201301290000'),
(171, 'কিন্তু ভারতকে তাদের ঘরের মাটিতে প্রথমবারের মতো হোয়াইটওয়াশ করার স্বপ্ন পূরণ হলো না মিসবাহ-উল হক বাহিনীর ।  গতকাল দিল্লির ফিরোজ শাহ কোটলা স্টেডিয়ামে তৃতীয় ওয়ানডেতে আগে ব্যাট করতে নেমে পাকিস্তানের বিধ্বংসী বোলিংয়ে ১৬৭ রানেই গুটিয়ে যায় ভারতের ইনিংস ।  জয়ের জন্য ১৬৮ রানের টার্গেটে ব্যাট করতে নেমে পাকিস্তানও ব্যাটিং ব্যর্থতার প্রদর্শনী দেখিয়েছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181604', '201301070000'),
(172, 'অপর ম্যাচে রোনালদোর হ্যাটট্রিকে রিয়াল মাদ্রিদ ৪-০ গোলে উড়িয়ে দিয়েছে গেটাফকে ।  লিগে শীর্ষে থাকা বার্সার ২১ ম্যাচে এখন অর্জন ৫৮ পয়েন্ট ।  বার্সার সমান ম্যাচে রিয়ালের অর্জন ৪৩ পয়েন্ট ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185193', '201301290000'),
(173, 'এলসি খোলা ও নিষ্পত্তির পরিমাণও ভালো ।  এ মুহূর্তে ১ লাখ ৬৯ হাজার মেট্রিক টন ক্রুড অয়েল কোম্পানিগুলোর কাছে মজুত রয়েছে ।  এর মধ্যে পাম অয়েলের ক্রুড হচ্ছে ১ লাখ ২৩ হাজার টন ও সয়াবিন ৪৬ হাজার মেট্রিক টন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184740', '201301250000'),
(174, 'তবে যুক্তরাজ্যে নয় ।  খেলবেন ফ্রান্সের প্যারি সাঁ জার্মা ক্লাবের হয়ে, ইব্রাহিমোভিচের মতো প্লেয়ার যেখানে খেলেন ।  তবে ভিক্টোরিয়া বেকহ্যাম লন্ডনেই থাকবেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/02/06/1141', '201302060000'),
(175, 'এই জয়ের মধ্য দিয়ে মারে বছরের প্রথম গ্র্যান্ডস্লাম টুর্নামেন্টে লড়াইয়ের জন্য ভালোই আত্মবিশ্বাস পেলেন বলা যায় ।  তবে শিরোপা জয়ের এ লড়াইয়ে দিমিত্রভের বিপক্ষে সফলতা পেতে প্রচুর ঘাম ঝরাতে হয়েছে বর্তমান ইউএস ওপেন চ্যাম্পিয়ন মারেকে ।  প্রথম সেটে দিমিত্রভের বিপক্ষে ৪-১ সেটে হেরে যান তিনি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181609', '201301070000'),
(176, 'ব্যাট করতে নেমে ৭১ রানের পার্টনারশিপ গড়ে দলকে দারুণ একটা সূচনা এনে দেন তামিম ইকবাল ও জেসে রাইডারের ওপেনিং জুটি ।  ২৪ বল খেলে ব্যক্তিগত ৩৭ রান নিয়ে রাইডার উইকেটছাড়া হলেও অবিচল থাকেন তামিম ।  দলীয় ১৪৮ রানে সাজ ঘরে ফেরার আগে ব্যক্তিগত ৭৪ রানের ইনিংস খেলেন তিনি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181611', '201301070000'),
(177, 'এই অগ্নিকাণ্ডে ওই গ্রামের কৃষক বাচ্চা মিয়া (৪৫) ও তার ছোট ভাই মৃত সিরাজুল হকের (৪০) ৪টি ঘর ভস্মীভূত হয় ।  এতে ঘরে থাকা ধান, চাল, গহনা ও আসবাবপত্রসহ লক্ষাধিক টাকার ক্ষতি হয়েছে ।  আগুনের সূত্রপাত কৃষক মৃত সিরাজুলের রান্নাঘর থেকে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189230', '201302230000'),
(178, 'কাজের ফাঁকে ফাঁকে অস্ট্রেলিয়ার বিভিন্ন জায়গা ঘুরেও বেড়াতে পারব ।  সবার কাছে দোয়া চাই যেন সব কাজই ভালো হয় ।  তাহমিনা সুলতানা মৌ আরও জানান, অস্ট্রেলিয়ার সিডনি ও মেলবোর্নে ছয়টি নাটকের শুটিং হবে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181631', '201301070000'),
(179, 'বিপিএলের তৃতীয় ভেন্যু এমএ আজিজ স্টেডিয়ামে অবশ্য এমন দৃশ্য দেখতে হবে না বলেই বিশ্বাস চট্টগ্রামের স্থানীয় আয়োজকদের ।  চট্টগ্রাম পর্বের টিকিট বিক্রি শুরুর একদিন আগে ঘটা করে সংবাদ সম্মেলনের আয়োজন করেছিল টিকিট বিক্রির স্বত্ব পাওয়া অ্যাকটিভ সার্ভিসেস ।  সংবাদ সম্মেলনে তারা জানিয়েছিল, ঢাকা ও খুলনার মতো ফাঁকা গ্যালারির দৃশ্য চট্টগ্রামে দেখা যাবে না ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184634', '201301250000'),
(180, 'তার জায়গায় ডাক পেয়েছেন ক্রিস ওয়াকেস ।  ইংল্যান্ড টেস্ট দলে এখনও অভিষেক হয়নি ওয়াকেসের ।  টেস্টে এখনও অভিষেক না হলেও ইংল্যান্ডের হয়ে ৭টি ওয়ানডে ও তিনটি টি-টোয়েন্টি ম্যাচ খেলেছেন ২৩ বছর বয়সী এই বোলিং অলরাউন্ডার ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184637', '201301250000'),
(181, 'বিষয়টি সিডিএ’র পক্ষ থেকে প্রথমে গোপন রাখা হলেও পরে গোমর ফাঁস হয় ।  সিডিএ সূত্র জানায়, ২০০৮ সালে পতেঙ্গা থেকে সাগরিকা পর্যন্ত সাগরের উপকূল দিয়ে ২২ কিলোমিটার দৈর্ঘ্যের চিটাগাং আউটার রিং রোড নামের একটি প্রকল্প হাতে নেয় সিডিএ ।  পরিকল্পনা অনুযায়ী এ প্রকল্পটি বাস্তবায়ন হলে রিং রোডের সঙ্গে সাগরের ভাঙন থেকেও শহরকে রক্ষা করবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/183006', '201301150000'),
(182, 'এমএ চিদাম্বরম স্টেডিয়ামে টস জিতে আগে ব্যাট করার সিদ্ধান্ত নেন অজি অধিনায়ক মাইকেল ক্লার্ক ।  ব্যাট করতে নেমে অস্ট্রেলিয়ার দুই ওপেনার এড কাওয়ান ও ডেবিড ওয়ার্নার ৬৪ রানের সূচনা এনে দেন ।  অস্ট্রেলিয়ার উদ্বোধনী জুটি ভাঙেন অশ্বিন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189178', '201302230000'),
(183, 'আজ সিরিজের তৃতীয় ও শেষ ওয়ানডেতে ইংল্যান্ডের মুখোমুখি হবে নিউজিল্যান্ড ।  স্বাগতিক নিউজিল্যান্ডের বিপক্ষে প্রায় ২১ বছরের ওয়ানডে সিরিজ জয়ের খরা কাটিয়ে ওঠার লক্ষ্যে মাঠে নামছে অ্যালিস্টার কুক বাহিনী ।  নেপিয়ারে গত ম্যাচে চমত্কার ব্যাটিং নৈপুণ্য দেখিয়ে ছিলেন ইংলিশ টপঅর্ডার চার ব্যাটসম্যান ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189182', '201302230000'),
(184, 'দ্বিতীয়ার্ধে টানা দুই গোল করেও শেষ পর্যন্ত ৫-২ গোলে হারের লজ্জা নিয়ে মাঠ ছাড়তে হয়েছিল বাংলাদেশকে ।  এরপর শক্তিশালী চীনের বিরুদ্ধে দুর্দান্ত এক জয় তুলে নেয় জিমি-চয়নরা ।  ৩-২ গোলে হারিয়ে প্রায় এক দশক পর চীনকে হারানোর উত্সব করে লাল-সবুজরা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189184', '201302230000'),
(185, 'আলাপচারিতায় শাহীন জানান, কাঞ্চন গ্রামের লতিফ চৌধুরী তার বাবা ।  দীর্ঘদিন ধরে তিনি পুরাতন কাগজ ক্রয়-বিক্রয়ের সঙ্গে জড়িত ছিলেন ।  স্থানীয় ফেরীওয়ালাদের কাছ থেকে কাগজ কিনে তিনি তা ট্রাক বোঝাই করে ঢাকাসহ দেশের বিভিন্ন অঞ্চলে পাঠিয়ে দিতেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184711', '201301250000'),
(186, 'পাহাড়ের এ বাঁশ চন্দনাইশের অর্থনীতিতে গুরুত্বপূর্ণ ভূমিকা রেখে চলেছে দীর্ঘদিন থেকে ।  এ বাঁশ-বেত দিয়ে নানারকম উপকরণ তৈরি করে জীবিকা নির্বাহ করছে চন্দনাইশের ২০ হাজারের অধিক মানুষ ।  সরকারি পৃষ্ঠপোষকতায় পরিকল্পিতভাবে কাজে লাগাতে পারলে চন্দনাইশের অর্থনীতিতে বিপ্লব ঘটাতে পারবে পাহাড়ি এ বাঁশ ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184712', '201301250000'),
(187, 'কিন্তু কারখানাটি সচল রাখার জন্য বিদ্যুতের প্রয়োজন হয় ১৩ মেগাওয়াট ।  বাকি ৩ মেগাওয়াট বিদ্যুত্ পিডিবি’র ঘোড়াশাল তাপ বিদ্যুেকন্দ্র থেকে আমদানি করতে হয় ।  কিন্তু সম্প্রতি ঘোড়াশাল তাপ বিদ্যুেকন্দ্র ৩ মেগাওয়াট বিদ্যুত্ সরবরাহ বন্ধ করে দেয়ায় গত বছরের ২৫ ডিসেম্বর থেকে কারখানার উত্পাদন বন্ধ করে দেয় কারখানা কর্তৃপক্ষ ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181586', '201301070000'),
(188, 'কিন্তু মালগাড়ির রেকের অভাবে প্রয়োজনের তুলনায় পশ্চিমবঙ্গে কম পেঁয়াজ ঢুকছে ।  এদিকে সবজির দাম আকাশছোঁয়া এবং এর ওপর সরকারের কোনো নিয়ন্ত্রণ নেই বলে খোলাখুলি জানিয়ে দিলেন কেন্দ্রীয় কৃষিমন্ত্রী শারদ পাওয়ার ।  তবে দ্রুত দাম কমবে বলে তিনি যথারীতি ফের আশ্বাসবাণী শুনিয়েছেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186537', '201302060000'),
(189, 'এদিকে শেয়ারবাজারে দরপতনের প্রতিবাদে গতকালও বিক্ষোভ করেছে সাধারণ বিনিয়োগকারীরা ।  লেনদেন শেষ হওয়ার পর বাংলাদেশ পুঁজি বিনিয়োগকারী ঐক্যপরিষদের নেতারা বিক্ষোভ প্রদর্শন করেন ।  এ সময় তারা বিএসইসি চেয়ারম্যান, ডিএসই প্রেসিডেন্টের বিরুদ্ধে নানা ধরনের স্লোগান দেন এবং তাদের পদত্যাগ দাবি করেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190951', '201303070000'),
(190, 'বাংলাদেশ ব্যাংকের বৈদেশিক মুদ্রানীতি বিভাগের হালনাগাদ প্রতিবেদনে এসব তথ্য পাওয়া গেছে ।  পরিসংখ্যানে দেখা যায়, ডিসেম্বরে শিল্পখাতে ব্যবহারযোগ্য কাঁচামাল, ইয়ার্ন, ফেব্রিক্স, কম্পিউটার ও এক্সেসরিজ আমদানিতে খরাভাব কাটেনি ।  গত অর্থবছর থেকে আমদানিতে স্থবিরতা দেখা দেয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184606', '201301250000'),
(191, 'এ প্রক্ষিতে ট্রেজারি সিকিউরিটিজের মূল্য, ইল্ড, রেপো মূল্য ও সুদ হার হিসাবে বছর গণনায় ৩৬৫ দিন নির্ধারণ করা হয়েছে ।  আগে ট্রেজারি বিলের বছর ৩৬০ দিনে গণনা করা হতো ।  সূত্রমতে, সরকারি সিকিউরিটিজের সেকেন্ডারি বাজারের ট্রেজারি বিল ও বন্ড অনলাইনে ক্রয়-বিক্রয়ে মার্কেট ইনফ্রাস্ট্রাকচার মডিউল সফটওয়্যারের মাধ্যমে ট্রেডার ওয়ার্ক স্টেশন (টিডব্লিউএস) গত ১৭ ডিসেম্বর উদ্বোধন করা হয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184608', '201301250000'),
(192, 'পর্যায়ক্রমে তা বাড়ছে ।  আসলে এই ছবিটিতে আমার অনেক আবেগ ও ভালোবাসা মিশে আছে ।  এটি এরই মধ্যে বিশ্বের বিভিন্ন দেশে প্রশংসিত হয়েছে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/25/184614', '201301250000'),
(193, 'বৈঠকে প্রতি কিলোমিটার পথের জন্য ১৫ পয়সা ভাড়া বাড়ানো হতে পারে ।  এ হার কার্যকর হলে কিলোমিটারপ্রতি ভাড়া বেড়ে দাঁড়াবে এক টাকা ৫০ পয়সা ।  বর্তমানে দূরপাল্লার বাসের প্রতি কিলোমিটারে ভাড়া এক টাকা ৩৫ পয়সা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/183049', '201301150000'),
(194, 'এজন্য ব্যয় হবে ২৪ হাজার ৩৯৪ কোটি টাকা বা ৩০৫ কোটি মার্কিন ডলার বিশ্বব্যাংকের চুক্তিতে যা ছিল ২৯০ কোটি ডলার ।  এজন্য চার বছর ধরে অর্থ সাশ্রয়ের মাধ্যমে সংযম করতে হবে ।  বাজেটে বরাদ্দের সঙ্গে বাড়াতে হবে রাজস্ব আয়ও ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186554', '201302060000'),
(195, 'গোলশূন্য ড্র’র এ ম্যাচ শেষে শিরোপা প্রত্যাশীদের ১৭ পয়েন্ট নিয়ে লিগের প্রথম পর্ব শেষ করতে হলো ।  শীর্ষে থাকা শেখ রাসেল ক্রীড়াচক্রের সঙ্গে তাদের পয়েন্টের ব্যবধান ২ ।  আর এক পয়েন্ট বেশি নিয়ে আবাহনীর ওপরে আছে শেখ জামাল ধানমন্ডি ক্লাব ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183960', '201301210000'),
(196, 'উত্পাদন ও আমদানি-রফতানিও তাদের কব্জায় ।  সরকারের ঘনিষ্ঠ হিসেবে তারাই সর্বেসর্বা ।  এদের বেপরোয়া থাবা থেকে রেহাই পায়নি বিকাশমান পোলট্রি শিল্পও ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186555', '201302060000'),
(197, 'সিলেট রয়্যালসের স্পিনার সোহাগ গাজীর ঘূর্ণিতে দলীয় ৯ রানেই ওপেনার তামিম ইকবাল ও মুক্তার আলীকে হারিয়ে ব্যাটিং বিপর্যয়ে পড়ে যায় রাজশাহী ।  এমন অবস্থায় তৃতীয় উইকেট জুটিতে মইন আলী ও জহুরুল ইসলাম ৬৩ রানের পার্টনারশিপ গড়লে হালে পানি পায় দলটি ।  ধীরে ধীরে দলীয় ইনিংসকে এগিয়ে নিয়ে যেতে থাকা এ জুটির লাগাম টানেন এলটন চিগাম্বুরা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183965', '201301210000'),
(198, 'ম্যাচে ১-০ গোলের ব্যবধানে সাইফুল বারী টিটোর শিষ্যদের ধরাশায়ী করে ধানমন্ডির দলটি ।  প্রথম পর্বেও মোহামেডানের বিরুদ্ধে সমান ব্যবধানে জয় পেয়েছিল শেখ জামাল ।  নাইজেরিয়ান স্ট্রাইকার সানডে জয়সূচক গোলটি করেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186562', '201302060000'),
(199, 'দুই ম্যাচ আগেই আজ সিরিজ জয় নিশ্চিত করতে চায় অস্ট্রেলিয়া ।  গত ম্যাচে দারুণ পারফরম্যান্স দেখিয়েছেন জর্জ বেইলি ও মিচেল স্টার্ক ।  ব্যাট হাতে বেইলির অপরাজিত সেঞ্চুরির (১২৫*) পর স্টার্কের বিধ্বংসী বোলিংয়ে এলোমেলো হয়ে যায় উইন্ডিজ ব্যাটিং লাইনআপ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186564', '201302060000'),
(200, 'বিদ্যুত্ খাতের পাঁচ প্রকল্পে মোট বরাদ্দ দেয়া হয়েছে ৫ হাজার ২৯৭ কোটি টাকা ।  কঠোর গোপনীয়তার মধ্যেই জাতীয় অর্থনৈতিক পরিষদের নির্বাহী কমিটি (একনেক) গতকাল এসব প্রকল্পের অনুমোদন দেয় ।  রাজধানীর এনইসি সম্মেলন কক্ষে প্রধানমন্ত্রী শেখ হাসিনার সভাপতিত্বে একনেক সভা অনুষ্ঠিত হয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186571', '201302060000'),
(201, 'মানুষের কান্না সব সময় অশ্রুজল না হয়ে পাথরে জমাট বেঁধেছে ।  আমরা এর নাম দিই তাজমহল এক বিন্দু নয়নের জল ।  মানুষ বঞ্চিত হলে সেই ভালোবাসার কাহিনী কখনও অক্ষরে রচনা করে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182880', '201301150000'),
(202, 'এলবোয় চোটগ্রস্ত হয়ে প্রথম টেস্ট থেকে ছিটকে পড়েন ইংলিশ অফস্পিনার গ্রায়েম সোয়ান ।  তার জায়গায় খেলছেন আরেক স্পিনার মন্টি পানেসার ।  চোট কাটিয়ে ইংল্যান্ড দলে ফিরেছেন স্টুয়ার্ট ব্রড ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190881', '201303070000'),
(203, 'ইন্টারনেট লিঙ্ক না থাকায় কাস্টমস ও বন্দর কর্মকর্তারা অফিসিয়াল কাজকর্ম করতে পারছেন না ।  আমদানি বাণিজ্য বন্ধ থাকায় পেট্রাপোল বন্দরে শত শত ট্রাক বাংলাদেশে প্রবেশের অপেক্ষায় দাঁড়িয়ে আছে ।  বেনাপোল চেকপোস্ট কার্গো শাখার সহকারী রাজস্ব কর্মকর্তা আবু সাঈদ জানান, পেট্রাপোল বন্দরে নেটওয়ার্ক সমস্যার কারণে তারা অফিসিয়াল কার্যক্রম সম্পন্ন করতে না পারায় দুপুর ১২টা থেকে আর কোনো ভারতীয় ট্রাক পণ্য নিয়ে বেনাপোল বন্দরে প্রবেশ করেনি ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190848', '201303070000'),
(204, 'চলতি মাসে কারখানার কমান্ড এরিয়াভুক্ত ৭টি জেলায় ৬৫০ ডিলারের মধ্যে ৭১ হাজার মেট্রিক টন ইউরিয়া সার বরাদ্দ দেয়া হয় ।  কর্তৃপক্ষ বরাদ্দ করা সার মাসে ২ কিস্তিতে ডিলারদের জমা দেয়ার সুযোগ দিলেও প্রথম কিস্তির জমার শেষ তারিখ ১৫ জানুয়ারি পর্যন্ত বরাদ্দ করা সারের শতকরা ২২ ভাগ জমা হয়েছে ।  ৭১ হাজার টনের মধ্যে ১৫ হাজার ৭৭৪ মেট্রিক টন ডিও জমা হয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183925', '201301210000'),
(205, '২০১২ সালে তারা কেন্দ্রীয় চুক্তিতে ছিলেন ।  ১৫ জনের তালিকায় ‘এ’ প্লাস শ্রেণীতে আছেন অধিনায়ক মুশফিকুর রহিম, সহ-অধিনায়ক মাহমুদউল্লাহ রিয়াদ, সাকিব আল হাসান, তামিম ইকবাল, আবদুর রাজ্জাক ও মাশরাফি বিন মুর্তজা ।  এই ছয়জন সবচেয়ে বেশি বেতন পাবেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182884', '201301150000'),
(206, 'এবারের আসরেও খেলবেন অনেকেই ।  তবে নানা কারণেই আসন্ন দ্বিতীয় আসরটি রঙ হারাতে পারে বলে মনে করছেন ক্রিকেট বোদ্ধারা ।  ১৭ জানুয়ারি বিপিএলের উদ্বোধন হওয়ার একদিন পরই খেলা মাঠে গড়াবে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182885', '201301150000'),
(207, 'তবে পরিকল্পনামাফিক সিরিজের পরবর্তী দুটি ম্যাচের জন্য ফেরানো হলো তাদের ।  ২০০৯ সালে সর্বশেষ ভারত সফরে খেলা অলরাউন্ডার মইসেস হেনরিকসের দলে ফেরাটা বেশ চমকের ।  শেন ওয়াটসনের অনুপস্থিতিতে দলে একজন অলরাউন্ডারের প্রয়োজন অনুভব করেই হেনরিকসকে দলে রেখেছেন নির্বাচকরা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182890', '201301150000'),
(208, 'এ জয়ে নিকটতম প্রতিদ্বন্দ্ব্বী অ্যাথলেটিকো মাদ্রিদের সঙ্গে ১১ পয়েন্টের ব্যবধান বাড়াল বার্সা ।  টানা চতুর্থ ব্যালন ডি’অর জেতার পর একটি গোলও করেছেন লিওনেল মেসি ।  আরেকটি গোল বানিয়েও দিয়েছেন আর্জেন্টাইন তারকা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182891', '201301150000'),
(209, 'কলকাতার বাংলা কিছু পত্রিকায়ও দেশীয় নাটকের রিভিউ হতো পরম যত্নে ।  বিশেষ করে হুমায়ূন আহমেদে রচিত জনপ্রিয় ধারাবাহিকগুলো কলকাতার দর্শকরাও দেশীয় দর্শকদের মতো আগ্রহভরে উপভোগ করতেন ।  বিটিভি থেকে আমাদের টিভি নাটকের যে পথচলা শুরু হয়েছে, পরবর্তীকালে তা দেশীয় স্যাটেলাইট চ্যানেলের কল্যাণে নতুন মাত্রা পায় ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189268', '201302230000'),
(210, 'এ রেটিংয়ের মারাত্মক প্রভাবও পড়েছিল দেশটির অর্থনীতিতে ।  যুক্তরাষ্ট্র এই প্রথম কোনো রেটিং সংস্থার বিরুদ্ধে মামলার করতে যাচ্ছে ।  তবে এস অ্যান্ড পি জানিয়েছে, যুক্তরাষ্ট্রের বিচার বিভাগ তাদের অবহিত করেছে, ২০০৭ সালে বন্ধকী ঋণের ক্ষেত্রে আমাদের দেয়া রেটিংয়ের ওপর ভিত্তি করে এ মামলা দায়ের করা হবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186607', '201302060000'),
(211, 'অন্য দোকানগুলোর কোোন বৈধতা নেই ।  এ অবৈধ দোকানগুলোর মধ্যে সার্বক্ষণিক দোকানের সংখ্যা ৮টি ।  বাকিগুলো সান্ধ্যকালীন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/07/190856', '201303070000'),
(212, 'রাজশাহীর কাজীহাটার ছেলে মধুর মিডিয়াতে যাত্রা শুরু মাত্র আঠারো বছর বয়সে রাজশাহীর বিভিন্ন নাট্যদলে অভিনয় করে ।  ১৯৬২ সালে বেতারে এবং ১৯৬৯ সালে টেলিভিশনে কাজ শুরু করেন ।  সেই থেকে এখন পর্যন্ত অনেক নাটকে অভিনয় করেছেন তিনি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/23/189269', '201302230000'),
(213, 'মূলধন বৃদ্ধির জন্য কোম্পানি ১০ টাকা ফেসভ্যালুর ৫১ লাখ ৩ হাজার সাধারণ শেয়ার ছেড়ে ৫ কোটি ১০ লাখ ৩০ হাজার টাকা সংগ্রহ করবে ।  তবে শেয়ারটি শুধু ইন্টারন্যাশনাল ফিন্যান্স করপোরেশনের (আইএফসি) অনুকূলে ইস্যু করা হবে ।  অন্য কেউ শেয়ারটি কিনতে পারবেন না ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186609', '201302060000'),
(214, 'কয়েকটি শর্ত পূরণ সাপেক্ষে দুই কিস্তিতে ঋণের টাকা পাবে বাংলাদেশ ।  চুক্তির আলোকে প্রথম পর্বে বাংলাদেশ পাবে ১১ মিলিয়ন ডলার ।  আর দ্বিতীয় কিস্তিতে পাওয়া যাবে ১০ মিলিয়ন ডলার ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/184057', '201301210000'),
(215, 'চলতি টুর্নামেন্টে ঢাকা সিলেটের এটি দ্বিতীয় দ্বৈরথ ।  এর আগে খুলনার শেখ আবু নাসের স্টেডিয়ামে এই দু’দলের প্রথম দ্বৈরথে সিলেটের কাছে ৭ উইকেটে হারতে হয় শক্তিশালী ঢাকাকে ।  আজকের ম্যাচে এর শোধ নিতে মরিয়া মাশরাফি বিন মর্তুজার ঢাকা গ্ল্যাডিয়েটর্স ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185190', '201301290000'),
(216, '৫১ মিনিটে আবাহনীর তরুণ স্ট্রাইকার রনি আরেকটি গোল করেন (৩-০) ।  ম্যাচে আবাহনীর আক্রমণের ধার ও গতি দেখে মনে হচ্ছিল, স্বাগতিকরা বড় হারের লজ্জা নিয়েই মাঠ ছাড়বে ।  কিন্তু ৩-০ গোলে পিছিয়ে পড়েও হতোদ্যম হয়নি স্বাগতিক ফেনী সকারের ফুটবলাররা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185191', '201301290000'),
(217, 'এজন্য পারিশ্রমিক কমিয়ে দিই ।  ছবিতে কাজ করে খুব মজা পেয়েছি আমি ।  আশা করছি আমার মতো দর্শকেরও ভালো লাগবে গল্পটি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/184054', '201301210000'),
(218, 'দিনের অপর ম্যাচে ম্যানসিটি ৩-০ গোলে হারায় চ্যাম্পিয়নশিপ লিগের ক্লাব ওয়াটফোর্ডকে ।  লিভারপুল থেকে ফ্রি ট্রান্সফারে ফের আগের ক্লাবে ফিরে এসেই দলকে জয় উপহার দিতে যাচ্ছিলেন জো কোল ।  ৩১ বছর বয়সী এই খেলোয়াড়ের জোড়া গোলে জয়ের অপেক্ষায়ই ছিল ওয়েস্ট হ্যাম ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181607', '201301070000'),
(219, 'উত্তর লন্ডনের এই ক্লাবটি তাদের ওয়েবসাইটে জানায়, জার্মানির অনূর্ধ্ব-২১ দলের অধিনায়ক লুইস হল্টবির সঙ্গে তারা সমঝোতায় পৌঁছেছে ।  বুন্দেসলিগা ক্লাব শালকে ছেড়ে আগামী জুলাই নাগাদ তাদের সঙ্গে যোগ দিতে পারেন হল্টবি ।  অনূর্ধ্ব-২১ দলের জার্মান অধিনায়ককে দলে পেতে অবশ্য কোনো ট্রান্সফার ফি দিতে হচ্ছে না টোটেনহামকে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181610', '201301070000'),
(220, '২৪ তারিখ থেকে টিকিট বিক্রির শুরুর দিন থেকেই চট্টগ্রামে বিপিএল উত্তেজনা ছড়াতে থাকে ।  স্থানীয় আয়োজকদের আশা ছিল ঢাকা-খুলনার দর্শক খরা চট্টগ্রামে দেখা যাবে না ।  এজন্য কয়েকদিন নগরজুড়ে চালানো হয় প্রচার-প্রচারণা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185198', '201301290000'),
(221, 'অনুষ্ঠানে শুভ মহরত ঘোষণা করেন গুণী চিত্রপরিচালক শহীদুল ইসলাম খোকন ।  অন্যান্যের মধ্যে সেখানে উপস্থিত ছিলেন চিত্রপরিচালক মুশফিকুর রহমান গুলজার, কাজী হায়াত্, শিল্পী চক্রবর্তী, জাকির হোসেন রাজু, সোহানুর রহমান সোহানসহ আরও অনেকে ।  নিজের নতুন ছবি নিয়ে অভিমত তুলে ধরতে গিয়ে মোস্তাফিজুর রহমান মানিক বলেন, ‘প্রচলিত গল্পের বাইরে একেবারেই ভিন্ন ধরনের একটি গল্প নিয়ে আমার নতুন ছবির শুটিং শুরু করেছি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/06/186635', '201302060000'),
(222, 'এছাড়া শেষ ওভার রুবেলকে দেয়া ঠিক হয়েছে কিনা এমন প্রশ্নের জবাবে রিয়াদের উত্তর, জাতীয় দলের নিউজল্যান্ডের সঙ্গে রুবেল শেষ ওভারে বোলিং করে জিতিয়ে ছিল ।  তাই আমি মনে করি না এটি ভুল সিদ্ধান্ত ।  অন্যদিকে সিলেট রয়্যালসের হয়ে সংবাদ সম্মেলনে হাজির হন খেলায় যৌথভাবে ম্যান অব দ্য ম্যাচ হওয়া মোহাম্মদ নবী ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185199', '201301290000'),
(223, 'দেখতে দেখতে প্রায় ১৫টি বছর কেটে গেছে দিতির ।  দীর্ঘ এ সময়ে তিনি জীবনে নানা রকম প্রতিবন্ধকতার মুখোমুখি হয়েছেন ।  তবে এখন সুন্দর একটি সময় এসে পৌঁছেছেন তিনি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/03/07/10242', '201303070000'),
(224, 'লাল সাদা নীল হলুদ এ শীতকাল সেজেছে শীত সম্ভারে ।  পোশাকের সঙ্গে মানানসই ফ্যাশনেবল শীত চাদর পাওয়া যাচ্ছে লাল সাদা নীল হলুদের সব শোরুমে ।  সব বয়সের নারী-পুরুষের ব্যবহার উপযোগী করে ডিজাইন করা হয়েছে চাদরগুলো ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/21/183903', '201301210000'),
(225, 'মোবারক শাসনামলে মিসর আমেরিকার কাছ থেকে বড় ধরনের অর্থনৈতিক সহায়তা পেত ।  তবে প্রেসিডেন্ট মুরসি বলছেন, দেশের সামাজিক ও অর্থনৈতিক সূচকগুলো লক্ষণীয় উন্নতির ইঙ্গিত দিচ্ছে ।  এদিকে মুরসি সম্প্রতি আন্তর্জাতিক অর্থ তহবিলের কাছ থেকে যে ৪৮০ কোটি ডলারের ঋণ নিতে চেয়েছেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181630', '201301070000'),
(226, 'এখানে অনুমতি মানে আপনি যে ওদের এফিলিয়েট করছেন সেটা ট্রাক করা দরকার ।  নইলে কীভাবে বোঝা যাবে যে আপনি এফিলিয়েশন করছেন? তাই অনুমতি নিতে হবে, আর অনুমতি মিললে ওরা আপনাকে একটা বিশেষ লিঙ্ক দেবে যাতে করে কেউ ওই লিঙ্কে ক্লিক করলে আপনার হিসাবে জমা হয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9998', '201302060000'),
(227, 'তবে তো বেশ মজাই হয়! ইন্টারনেটে এরকম বেশকিছু সাইট থাকলেও বাংলাদেশে পাঠানো যেত না সহজে ।  কিন্তু ফ্রি এসএমএস ডটনেট সাইটে সম্পূর্ণ বিনামূল্যে এসএমএস পাঠানো যায় বাংলাদেশের বিভিন্ন মোবাইল ফোন অপারেটরে ।  ফ্রি এসএমএস ডটনেট প্রথমেই ইন্টারনেট ব্রাউজার খুলে http://www.freesms.net সাইটটিতে প্রবেশ করুন ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9999', '201302060000'),
(228, 'এতে মূল বক্তব্য উপস্থাপন করেন বেসিসের সহ-সভাপতি ও বেসিস স্ট্যান্ডিং কমিটি অন ইনফ্রাস্ট্রাকচার সৈয়দ আলমাস কবির ।  অনুষ্ঠানে অন্যান্যের মধ্যে বেসিসের সাবেক সভাপতি এ তৌহিদ, সারওয়ার আলম ও মাহবুব জামান উপস্থিত ছিলেন ।  অনুষ্ঠানে ধন্যবাদ জ্ঞাপন করেন আইসিটি ইনকিউবেটর ব্যবস্থাপনা কমিটির চেয়ারম্যান আমির হোসেন ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/10000', '201302060000'),
(229, 'শতকরা হিসাবে রাজস্ব আয়ের পরিমাণ কমেছে ৪৭ শতাংশেরও বেশি ।  ডিএসই সূত্রে এ তথ্য জানা গেছে ।  সংশ্লিষ্ট সূত্রে জানা যায়, শেয়ারবাজার থেকে সরকার দু’ভাবে রাজস্ব পেয়ে থাকে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/07/181636', '201301070000'),
(230, 'শীতের খোলসে ঢেকে থাকা কৃষ্ণচূড়া, রাধাচূড়া, নাগলিঙ্গম প্রকৃতির আদরমাখা স্পর্শে জেগে উঠেছে । পলাশ, শিমুলের প্রস্ফুটিত হাসিতে বনে লেগেছে আগুন রঙের খেলা । কোকিলের কুহুতানে মাতাল করতে এসেছে বসন্তরানী সবুজ-শ্যাম ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9989', '201302060000'),
(231, 'লেনদেন হয়েছে মাত্র ১১৯ কোটি ৩৭ লাখ টাকা । এটি শুধু চলতি বছরেরই নয়, গত ৬ মাসের মধ্যে ডিএসইর সর্বনিম্ন লেনদেন । এর আগে ডিএসইতে গত বছরের ৮ জুলাইয় সর্বনিম্ন ১১৫ কোটি ৭০ লাখ টাকার লেনদেন হয়েছিল ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182955', '201301150000'),
(232, 'এই ঋণের আওতায় তুরস্ক থেকে বাংলাদেশে রফতানি করা পণ্য ও সেবার ৮৫ শতাংশ পর্যন্ত অর্থায়ন করা হবে । ভোগ্যপণ্যের ক্ষেত্রে ঋণের সুদ হার হবে লাইবোর + ৩, যার মেয়াদ হবে ২ বছর । মূলধনী পণ্যের ক্ষেত্রে সুদ হার হবে লাইবোর +৩ দশমিক ৫০ এবং মেয়াদ হবে ৭ বছর ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182956', '201301150000'),
(233, '১৯৭ কোটি টাকায় নেয়া প্রকল্পটির প্রথম দফায় ব্যয় বাড়িয়ে বরাদ্দ দেয়া হয় ৩৭৮ কোটি ৯২ লাখ টাকা ।  কাজ শুরুর আগেই ব্যয়ভার আরেক দফায় বাড়ানো হচ্ছে । পরিকল্পনা কমিশনে এ বিষয়ে একটি প্রস্তাবনা পাঠিয়েছে শিল্প মন্ত্রণালয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182957', '201301150000'),
(234, 'ব্যাংকগুলো হলো—সোনালী ব্যাংক, বাংলাদেশ কৃষিব্যাংক, জনতা ব্যাংক ও রূপালী ব্যাংক এবং বেসরকারি খাতের স্ট্যান্ডার্ড ব্যাংক এবং ইসলামী ব্যাংক ।  পরিসংখ্যানে আরও দেখা যায়, সোনালী ব্যাংকের বিরুদ্ধে বিলসংক্রান্ত ৪৭০টি অভিযোগ এসেছে ।  এর মধ্যে ১৯৮টি নিষ্পত্তি হয়েছে এবং ১৭২টি অনিষ্পত্তিপূর্ণ রয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182958', '201301150000'),
(235, 'সে এ সমস্যার একটা স্থায়ী সমাধান চায় ।  তাই তাকে ভালো পরামর্শ দেন ।  না হলে তার ওই হুমকি থেকে আপনিও রেহাই পাবেন বলে মনে হয় না ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/25/9891', '201301250000'),
(236, 'আশা করি, বাজারে অচিরেই ইতিবাচক পরিবর্তন আসবে ।  তবে কারা কারা এ কমিটিতে থাকবেন এবং তাদের কার্যপরিধি কী হবে, এ বিষয়ে বিস্তারিত কোনো কিছু তিনি বলেননি ।  আজ দুপুরে সংবাদ সম্মেলনে এ বিষয়ে বিস্তারিত জানানো হবে বলে ডিএসইর পক্ষ থেকে বলা হয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185129', '201301290000'),
(237, 'যা অব্যাহত ছিল শেষদিন পর্যন্ত ।  প্রথম আসরেও ঢাকার হতাশার পর যেভাবে চট্টগ্রামে এসে প্রাণ ফিরে পেয়েছিল বিপিএল, ঠিক সেভাবে এবারও এখানে এসে বিপিএল যেন পেল প্রাণের ছোঁয়া ।  আর এতে আরও একবার প্রমাণ হলো, ক্রিকেট এবং চট্টগ্রামের দর্শক একসূত্রে গাঁথা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9984', '201302060000'),
(238, 'গতবারের মতো আলোকসজ্জা, ব্যানার-পোস্টারে প্রচারণা, শোভাযাত্রা, বিপিএল কাউন্টডাউনের জন্য স্থাপিত বিশাল ঘড়ি—এমন আয়োজনের কিছুই এবছর চোখে পড়েনি বন্দরনগরীতে ।  এমনকি স্থানীয় টিম চিটাগং কিংসেরও কোনো খবর নেই ।  গেলোবার চট্টগ্রামের ঐতিহ্যবাহী বিশাল মেজবানির মাধ্যমে নিজেদের খেলোয়াড় এবং দলের পরিচয়পর্ব সারলেও এবছর এখনও চট্টগ্রামের মাটিতে পা পড়েনি দলটির ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9857', '201301210000'),
(239, 'হাসতে হাসতে তখন ফারুকী ভাই বললেন, বাঁধন দাঁতে কোনো সমস্যা হলেই প্রথম তোমার কথা মনে পড়ে ।  শুধু ফারকুী ভাই-ই নন, আমি এ ধরনের কথা আমার সহকর্মীদের অনেকের মুখ থেকেই শুনতে পাই ।  এটা আমাকে অনেক আনন্দ দেয় ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/25/9878', '201301250000'),
(240, 'শুধু বার্সেলোনাকেই দিতে হবে ৩৫ কোটি টাকা ।  তাদের প্রতিপক্ষ হিসেবে একটি ভালো মানের দল আনতে হবে ।  ওই দলকেও বড় অঙ্কের টাকা দিতে হবে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9987', '201302060000'),
(241, '৩১ জানুয়ারি থেকে ১৭ ফেব্রুয়ারি পর্যন্ত ভারতের মুম্বাই শহরে হতে যাচ্ছে ২০১৩ সালের মহিলা বিশ্বকাপ ক্রিকেট ।  কিন্তু মুম্বাইতে পাকিস্তান দলের খেলা নিয়েই সৃষ্টি হয়েছে যত বিপত্তি ।  ইন্দো-পাক সীমান্তে সাম্প্রতিক উত্তেজনা আসন্ন প্রমীলা বিশ্বকাপে পাকিস্তান দলের অংশগ্রহণকে অনিশ্চয়তার মুখে ফেলেছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9859', '201301210000'),
(242, 'শুটিং স্পটে দেরি করে আসাটা তো এখন এখানে ফ্যাশন হয়ে দাঁড়িয়েছে ।  তবে একটা সত্য কথা না বললেই নয়, আমি যখন ‘আম্মাজান’ ছবির শুটিং করি, প্রথম দিন সকাল আটটায় আমি স্পটে গিয়ে হাজির হয়েছিলাম ।  কিন্তু সেদিন মান্না এসেছিল দুপুর দু’টায় ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/25/9880', '201301250000'),
(243, 'তরুণদের মধ্য থেকে অধিনায়ক বের হয়ে আসুক ।  বেসরকারি একটি টিভি চ্যানেলকে তিনি বলেন, ভারতীয় উপমহাদেশে পরিসংখ্যানভিত্তিক ক্রিকেট অর্থনীতি, যেখানে সবাই রেকর্ডের দিকে তাকায় ।  ভারত অথবা পাকিস্তান কতটা ম্যাচে জিতল সেদিকে তারা লক্ষ্য রাখে না ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9860', '201301210000'),
(244, 'সোশ্যাল মিডিয়া মার্কেটিং কি? সোশ্যাল মিডিয়া মার্কেটিং হচ্ছে ব্যক্তিগত, ক্ষু্দ্র ব্যবসা, বৃহত্ ব্যবসা এবং অলাভজনক প্রতিষ্ঠানের সমন্বিত প্রচার মাধ্যম প্রক্রিয়া ।  সমন্বিত মার্কেটিং যোগাযোগ হচ্ছে একটি অসাধারণ মাধ্যম, যার মাধ্যমে খুব সহজেই কোনো প্রতিষ্ঠানের টার্গেট মার্কেটে তাদের পণ্য সম্পর্কে প্রচার করা যায় ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185104', '201301290000'),
(245, 'বাণিজ্য মন্ত্রণালয়ের আইসিটি বিজনেস প্রমোশন কাউন্সিলের (আইবিপিসি) সহযোগিতায় নয় দিনব্যাপী এই আর্ন্তজাতিক সম্মেলনের আয়োজন করছে ইন্টারনেট সার্ভিস প্রোভাইডারস এসোসিয়েশন অব বাংলাদেশ (আইএসপিএবি) ।  এবারের সেনগ সম্মেলেনের মধ্যে রয়েছে সম্মেলন, কর্মশালা ও প্রশিক্ষণ ।  সম্মেলনের উদ্বোধনী অনুষ্ঠানে প্রধান অতিথি হিসাবে থাকবেন বিটিআরসি-র চেয়ারম্যান সুনীল কান্তি বোসসহ তথ্যপ্রযুক্তি সংশ্লিষ্ট ব্যক্তিরা ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/29/185255', '201301290000'),
(246, 'আর স্টাইলিশ ডিজাইনের গ্যালাক্সি ওয়াই এখন পাওয়া যাচ্ছে মাত্র ১০,৯০০ টাকায় ।  বিভিন্ন কালার কভার সংবলিত গ্যালাক্সি ওয়াই কালার প্লাস ক্রয় করা যাবে এখন ১২,৩০০ টাকায় (আগের মূল্য ১২,৭০০) ।  আর যারা সাশ্রয়ী মূল্যে স্মার্ট ডুয়াল সিম ফিচারসহ স্মার্টফোন ব্যবহার করতে চান তাদের জন্য গ্যালাক্সি ওয়াই ডুয়োসের মূল্য এখন ১৩,৯০০ টাকা (আগের মূল্য ১৪,৫০০) ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/15/182935', '201301150000'),
(247, 'আলোচনা সভায় অন্যান্যের মধ্যে উপস্থিত ছিলেন ঢাকা জেলা প্রশাসক শেখ ইউসুফ হারুন, অতিরিক্ত জেলা প্রশাসক মো. জিল্লুুর রহমান চৌধুরী এডিসি  ।  উপস্থিত ছিলেন বেসিস পরিচালক শাহ ইমরাউল কায়ীশ, বাংলাদেশ ব্যাংকের এসএম তোফায়েল আহমেদ, গ্রামীণফোনের এম হাফিজুর রহমান খান, ব্যাংক এশিয়ার কাজী মর্তুজা প্রমুখ ।  ই-বাণিজ্য মেলার ওপর প্রেজেন্টেশন উপস্থাপন করেন কম্পিউটার জগতের কারিগরি সম্পাদক আবদুল ওয়াহেদ তমাল ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/25/9874', '201301250000'),
(248, 'এই প্যাকেজগুলোর মাধ্যমে মাত্র ১৫ হাজার টাকার মধ্যে গুণগত মানের একটি এন্ট্রি লেভেল কম্পিউটার কেনা যাবে ।  শনিবার অনুষ্ঠিত গিগাবাইট মিট দ্য প্রেস এই ঘোষণা দেয়া হয় ।  এতে উপস্থিত ছিলেন গিগাবাইটের সেলস ডিরেক্টর এলান চ্যান ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/25/9875', '201301250000'),
(249, 'আবদুশ শাকুরের মৃত্যু আমার জন্য এক অপূরণীয় ক্ষতি ।  কারণ তাঁর নিয়মিত লেখা আমার সম্পাদিত ‘সরগম’ পত্রিকার প্রতি সংখ্যাকে করত সমৃদ্ধ ও পাঠকপ্রিয় ।  আমার সঙ্গে প্রায় প্রতি মাসেই তাঁর দেখা বা ফোনে কথা হতো ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9842', '201301210000'),
(250, 'এর মাধ্যমে প্রতিষ্ঠানের প্রত্যেক সদস্য তাদের আইডি কার্ড ব্যবহার করে প্রিন্টিং ও ফটোকপি করতে পারবেন ।  ফলে প্রত্যেকের ডকুমেন্টের নিরাপত্তা ও গোপনীয়তা নিশ্চিত করা সম্ভব হবে ।  স্যামসাং এলইডি টিভি এখন সাশ্রয়ী মূল্যে স্যামসাং এলইডি টিভি এখন পাওয়া যাবে হাতের নাগালে ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/29/9930', '201301290000'),
(251, 'রাজধানীর আগারগাঁওয়ে ডিআইটিএফের ১৮তম এ আসরে মোট ৫০৬টি স্টল রয়েছে ।  এর মধ্যে ৯০টি প্যাভিলিয়ন, ৪২টি মিনি-প্যাভিলিয়ন ও স্টল রয়েছে ৩৬২টি ।  বঙ্গবন্ধু স্মৃতি প্যাভিলিয়নের পাশাপাশি এবার সরকারি কয়েকটি প্রতিষ্ঠানের স্টল রয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/29/9917', '201301290000'),
(252, 'শরীরটাকে ফিট রাখাই একজন ক্রীড়াবিদের সাফল্যের পূর্বশর্ত ।  বিশ্বচ্যাম্পিয়নশিপকে সামনে রেখে শরীরটাকে ফিট রাখার লড়াইটা চালিয়ে যাচ্ছেন বোল্ট ।  এ মুহূর্তে শারীরিকভাবেও আছেন দারুণ অবস্থায় ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/29/9914', '201301290000'),
(253, 'কিন্তু আমারটা ঠিক আগের মতোই রয়েছে ।  আমি নাটকের কাজ ছাড়া আরও কিছু কাজও করি ।  অভিনয় নিয়ে আমি বরাবরই অনেক চুজি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/23/10130', '201302230000'),
(254, 'কিন্তু অফিস স্টাফদের কোনো কথাই গায়ে মাখে না সে ।  ম্যানেজার ছাড়া আর কেউ তার রুমে আসতে পারে না ।  তার কাছেই ব্যবসার খোঁজখবর নেয় সে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/23/10131', '201302230000'),
(255, 'ফুটবল ইতিহাসে এক বর্ষপঞ্জিতে সর্বোচ্চ গোলের রেকর্ডও মেসির দখলে ।  এক বর্ষপঞ্জিতে তার গোলসংখ্যা ৯১ ।  ২৫ বছর বয়সে জাদুকরী ফুটবল ক্যারিশমা দেখিয়ে রেকর্ডের ফুলঝুরি ছড়ালেও একটা আক্ষেপ রয়েই গেছে সময়ের সেরা এই ফুটবলারের ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/15/9792', '201301150000'),
(256, 'আইপিএলকে অনুসরণ করে এবার সেই নিয়মে পরিবর্তন আনা হয়েছে ।  প্রথম পর্বে প্রতিটি দল পরস্পরের সঙ্গে মুখোমুখি লড়াইয়ের পর পয়েন্ট টেবিলের শীর্ষ দুই দলের মধ্যে ‘রেস টু ফাইনাল’ ম্যাচ অনুষ্ঠিত হবে ।  এই ম্যাচে জয়ী দল সরাসরি খেলবে ফাইনালে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/15/9793', '201301150000'),
(257, 'আর এ কারণেই ছবিটিতে কাজের প্রতি আমি আগ্রহী হয়ে উঠি ।  আমার বিশ্বাস, বিপ্লব ভাই অনেক যত্ন নিয়েই ছবিটি নির্মাণ করবেন ।  আমিও চেষ্টা করব আমার চরিত্রটি যথাযথভাবে ফুটিয়ে তুলতে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/23/10135', '201302230000'),
(258, 'কবিরা যেমন কবিতা লিখে প্রভূত আনন্দ পান, তেমনি কবিতা পাঠ করে শোনাতেও তাদের উত্সাহ-উদ্দীপনা প্রচুর ।  কবির স্বকণ্ঠে আবৃত্তি পাঠ-শ্রোতার জন্য যেন সোনায় সোহাগা ।  কাব্যরসিকদের জন্য সেটা একটি বাড়তি পাওনা বৈকি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9848', '201301210000'),
(259, 'প্রবেশপথে সংক্ষিপ্ত এক আয়োজনে জাকা আশরাফ দলের দুই অধিনায়ক মিসবাহ উল হক ও মোহাম্মদ হাফিজকে পুষ্পমাল্য পরিয়ে দেন ।  পুরো সিরিজেই চিরপ্রতিদ্বন্দ্বীদের বিপক্ষে দুর্দান্ত পারফরমেন্স দেখায় পাকিস্তান ।  তিন ম্যাচের ওয়ানডে সিরিজের প্রথম দুটিতেই জিতে সিরিজ ঘরে তোলে সফরকারীরা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/15/9795', '201301150000'),
(260, 'প্রকৃতপক্ষে ইন্টারনেট সেবাকে জনপ্রিয় করতে মোবাইল ফোনই বিশেষ ভূমিকা পালন করছে ।  ব্রডব্যান্ড ইন্টারনেটের পাশাপাশি ওয়াইম্যাক্স ইন্টারনেট সেবাও জনপ্রিয় হচ্ছে ।  বর্তমানে দেশে ২.৫ লাখের মত ওয়াইম্যাক্স ইন্টারনেট ব্যবহারকারী রয়েছে ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/23/10122', '201302230000'),
(261, 'যখন লুজ হয়, তখন স্ক্রু ঢিল থাকে বিধায় সবাই ওকে বোকা বানায় ।  ওর আবার সবচেয়ে প্রিয় শখ বাজি ধরা ।  বাজিতে নাকি জেতেও ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9951', '201302060000'),
(262, 'খেলার একটি টিমে আমাদের এক পরিচিত আঙ্কেল খেলা করছেন ।  হঠাত্ করে উনি আমাকে ইশারা দিয়ে ডেকে পকেট থেকে দু’টাকা বের করে বললেন একটি আইসক্রিম আনতে ।  আমি ওই টাকা দু’টি আমার ছোট ভাই বাপ্পুকে দিলাম ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9952', '201302060000'),
(263, 'এ পরিসংখ্যান অনুযায়ী বোঝা যাচ্ছে, ইন্টারনেটে মোবাইলের বাজার বেশ বৃহত্ ।  বিক্রয় ডট কমে সেকেন্ড হ্যান্ড মোবাইলের লেনদেন দেশব্যাপী ৮২ ভাগ বৃদ্ধি পেয়েছে বলে জানা গেছে ।  বাংলাদেশে সেকেন্ড হ্যান্ড মোবাইল বিক্রয়ের প্রধান শহরগুলো হচ্ছে ঢাকা, চট্টগ্রাম, খুলনা এবং রাজশাহী ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/23/10124', '201302230000'),
(264, 'সিনেমা হল তো আমার খালুর নয় যে বিনে পয়সায় দেখাবে ।  আইডিয়া হলো, গাছ থেকে সুপারি পাড়ব, বিক্রি করব, সিনেমা দেখব—অতঃপর বাদাম খাব ।  আইডিয়া মতো কাজ ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/02/06/9961', '201302060000'),
(265, 'অভিনেত্রী হিসেবেও তার গ্রহণযোগ্যতা কম নয় ।  নাটকের পাশাপাশি তিনটি চলচ্চিত্রেও অভিনয় করেছেন এই কথার রানী ।  তার সাক্ষাত্কার নিয়েছেন রকিব হোসেন হ্যালো ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/02/02/22527', '201302020000'),
(266, 'এভাবেই চলছিল ক্যামেরায় ছবি আঁকা । পিকনিকে আসা অতিথিদের একজন তিন কন্যার এই ব্যস্ততা দেখে মজা করে বলেই ফেললেন, ঢেঁকি নাকি স্বর্গে গেলেও বাড়া ভানে ।  পিকনিকে এসেও নিয়মিত রুটিনের এই কাজটুকু বেশ আনন্দেই করলেন তিন তারকা ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9817', '201301210000'),
(267, 'এখন থেকে হয় পুরো অ্যালবাম ।  নয়তো কিছু নয় ।  এই হচ্ছে বছরের শুরুতে বেলাল খানের উপলব্ধি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9818', '201301210000'),
(268, 'তবে এবার কিছু হলেও হতে পারে ।  কোনো ছবির শুটিংয়ে নয় স্রেফ দুই বাংলার চলচ্চিত্র বিনিময়ের রাস্তা পরিষ্কার করতে গত বৃহস্পতিবার ঢাকায় এসেছিলেন জিত ।  পরদিন শুক্রবারই চলে যেতে হয় তাকে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weekly_news/2013/01/21/9819', '201301210000'),
(269, 'দিনের অপর ম্যাচে ব্রাদার্সকে রুখে দিয়েছে ফেনী সকার ক্লাব ।  ম্যাচটি ছিল গোলশূন্য ড্র ।  বঙ্গবন্ধু জাতীয় স্টেডিয়ামে অনুষ্ঠিত ম্যাচের ১১ মিনিটেই এগিয়ে যাওয়ার সুযোগ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/02/20/22811', '201302200000'),
(270, 'যেহেতু আমি রাজনীতি করি ।  আমার দল বিএনপি ।  আমি জানি আমার শ্রোতাদের মধ্যে দুটি ভাগ হয়ে গেছে ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/01/30/22484', '201301300000'),
(271, 'নানা বয়সের দর্শক নাটক দু’টি উপভোগ করেন ।  নাটক দু’টি গত সন্ধ্যায় শিল্পকলা একাডেমীর নাট্যশালার মূল মিলনায়তন ও এক্সপেরিমেন্টাল থিয়েটার হলে মঞ্চস্থ হয় ।  এছাড়া নাট্যমেলা উপলক্ষে গতকাল বিকালেও প্রাচ্যনাটের উদ্যোগে মিলিত সঙ্গীতের আয়োজন করা হয় ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193560', '201303250000'),
(272, 'এদিকে ওয়ানডে সিরিজে নিজেদের সম্ভাবনা জিইয়ে রাখতে হলে আজকের ম্যাচে জয়ের কোনো বিকল্প নেই বাংলাদেশ দলের ।  প্রথম ম্যাচে যা-ই হোক না কেন, সিরিজ বাঁচাতে হলে আজকের ম্যাচে ঘুরে দাঁড়াতে হবে সফরকারীদের ।  তা না হলে আরও একটি ম্যাচে পরাজয়ের সঙ্গে সিরিজ পরাজয় নিয়েও মাঠ ছাড়তে হবে টাইগারদের ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193497', '201303250000'),
(273, 'বিজয়ী দলের পক্ষে জোড়া গোল করেন নাইজেরিয়ান ফরোয়ার্ড ডার্লিংটন ।  এছাড়া অপর গোলটি আসে কাঞ্চনের পা থেকে ।  এ জয়ে দুই ম্যাচে চার পয়েন্ট জমা হলো মুক্তিযোদ্ধার ঝুলিতে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193498', '201303250000'),
(274, 'মাগুরার সাকিব এখন জনপ্রিয় ক্রিকেটবিশ্বের প্রতিটি কোণে ।  বাংলাদেশ দলের হয়ে দ্যুতিময় পারফরম্যান্সই সাকিবকে নিয়ে আসে পাদপ্রদীপের আলোয় ।  ২০০৬ সালে হারারেতে জিম্বাবুয়ের বিপক্ষে মাঠে নামার মধ্য দিয়ে লাল-সবুজের জার্সি গায়ে আন্তর্জাতিক ওয়ানডে ক্রিকেটে অভিষেক হয় সাকিবের ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193507', '201303250000'),
(275, 'এ দুটি বিধানের বিষয়ে প্রয়োজনীয় সহযোগিতা চেয়ে এরই মধ্যে পুঁজিবাজার নিয়ন্ত্রক সংস্থা সিকিউরিটিজ অ্যান্ড এক্সচেঞ্জ কমিশনের (বিএসইসি) কাছে চিঠি পাঠিয়েছে অর্থ... অর্থনৈতিক রিপোর্টার বিশ্ব অর্থনীতি রাশিয়ার কেন্দ্রীয় ব্যাংকের চেয়ারম্যান হচ্ছেন একজন নারী রাশিয়ার কেন্দ্রীয় ব্যাংকের সর্বোচ্চ পদ অলঙ্কৃত করবেন একজন নারী ।  সেন্ট্রাল ব্যাংকের চেয়ারম্যান পদে এলভিরা নাবিউল্লিনার নিয়োগ প্রায় চূড়ান্ত পর্যায়ে রয়েছে ।  দেশটির প্রেসিডেন্ট ভদ্মাদিমির পুতিন জানিয়েছেন, সেন্ট্রাল ব্যাঙ্কের নতুন চেয়ারম্যানের... হেলিকপ্টারের বাণিজ্যিক ব্যবহার বাড়ছে বছর কয়েক আগেও শুধু বিয়ে আর সিনেমার শুটিংয়ে ব্যবহার হতো হেলিকপ্টার ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/03/17/23212', '201303170000'),
(276, 'তারপরও দু’বেলা দু’মুঠো খাওয়ার মতো একটি কেরানির চাকরি পেয়ে গেলাম ।  ক’দিন পরপর জিনিসপত্রের দাম যায় বেড়ে ।  আমার দিন যেন আর চলতেই চায় না ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193459', '201303250000'),
(277, 'শেখ আবু নাসের বিভাগীয় স্টেডিয়ামে চার দিনে আটটি ম্যাচ হবে ।  প্রথমবারের মতো কোটি ডলারের এ ক্রিকেট আসর খুলনায় আয়োজন করা হলেও এ নিয়ে তেমন উত্তেজনা নেই স্থানীয় ক্রিকেটপ্রেমীদের মাছে ।  এরই মধ্যে দলগুলো পৌঁছেছে খুলনায় ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/news/2013/01/22/22358', '201301220000'),
(278, 'পয়েন্ট তালিকার প্রথম স্থানে রয়েছে মুশফিকুর রহিমের সিলেট রয়্যালস ।  পয়েন্ট তালিকার ষষ্ঠ স্থানেই পড়ে থাকতে হলো রাজশাহীকে ।  চট্টগ্রামের এমএ আজিজ স্টেডিয়ামে গতকাল দিনের প্রথম ম্যাচে দুরন্ত রাজশাহীর বিপক্ষে টস জিতে প্রথমে ব্যাট করার সিদ্ধান্ত নেন ঢাকা গ্ল্যাডিয়েটর্সের অধিনায়ক মাশরাফি বিন মর্তুজা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185939', '201302020000'),
(279, 'ওয়েস্ট ইন্ডিজকে রীতিমত উড়িয়ে দিয়ে ৯ উইকেটের জয় পেয়ে ওয়ানডে সিরিজে দুর্দান্ত সূচনাই হয়েছে মাইকেল ক্লার্ক বাহিনীর ।  পাঁচ ওয়ানডে ম্যাচ সিরিজে এখন ১-০ ব্যবধানে এগিয়ে অজিরা ।  কাল সিরিজের দ্বিতীয় ম্যাচে মুখোমুখি হবে দু’দল ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185943', '201302020000');
INSERT INTO `pos_data_table` (`id`, `content`, `category`, `domain`, `url`, `date`) VALUES
(280, 'আইডিবি থেকে ১৪ কোটি ডলার ঋণ পেতে প্রয়োজনে নতুন করে চুক্তি করতেও রাজি আছেন বলে জানিয়েছেন অর্থমন্ত্রী ।  এর আগে সম্প্রতি অর্থমন্ত্রী আবুল মাল আবদুল মুহিত বলেছিলেন, দেশীয় অর্থায়নে পদ্মা সেতু বাস্তবায়ন করা হবে ।  প্রতি অর্থবছর বার্ষিক উন্নয়ন কর্মসূচিতে ৫ হাজার কোটি টাকা করে বরাদ্দ দেয়া হবে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193551', '201303250000'),
(281, 'এদিকে ৭ ম্যাচে ১৭ পয়েন্ট নিয়ে শেখ জামাল ধানমন্ডি ক্লাব এখন সবার ওপরে ।  ১৬ পয়েন্ট নিয়ে দ্বিতীয় স্থানে রয়েছে বর্তমান চ্যাম্পিয়ন আবাহনী ।  আর ফেডকাপ চ্যাম্পিয়ন শেখ রাসেলের ঝুলিতে ১৬ পয়েন্ট জমা থাকলেও আবাহনীর সঙ্গে গোল ব্যবধানটা পিছিয়ে দিয়েছে তাদের ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/13/182597', '201301130000'),
(282, 'আর এই তিন ব্যাটসম্যানের সেঞ্চুরির সুবাদে সেন্ট জর্জেস পার্কে দক্ষিণ আফ্রিকা প্রথম ইনিংসে রানের পাহাড়ই গড়েছে ।  এ রিপোর্ট লেখা পর্যন্ত ৮ উইকেটে ৫২৫ রান সংগ্রহ করে প্রথম ইনিংস ঘোষণা দেয় দক্ষিণ আফ্রিকা ।  এলগার ১০৩ রানে অপরাজিত ছিলেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/13/182601', '201301130000'),
(283, 'নাটকটি দশরূপক নাট্যদলের প্রথম প্রযোজনা ।  গতকাল নাটকটির তৃতীয় প্রদর্শনীর আয়োজন হয় ।  এতে অভিনয় করেন রিমা, লিপু, শাকিল আহমেদ প্রমুখ ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184526', '201301240000'),
(284, 'শ্রমিকদের জন্য মাত্র ২ মিনিটের টয়লেট বিরতির আদেশ জারি করা হয়েছে ।  আদেশ পালনে ব্যর্থ হলে জরিমানা ও বরখাস্ত করার বিধান রাখা হয়েছে ।  ওই আদেশ জারির পর সাংহাই ইলেকট্রিক কোম্পানির এক হাজার শ্রমিক বিদ্রোহ করেছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184529', '201301240000'),
(285, 'আশ্চর্যের বিষয় হলো, মেয়েটি অতনুর সঙ্গে পূর্ব পরিচয়ের কথা একেবারেই অস্বীকার করে ।  অন্যদিকে অতনুর মা ছেলের বউ হিসেবে লোপা নামের একজনকে পছন্দ করে ।  এমনই কাহিনী নিয়ে নাইস নূরের রচনায় ও ইরানী বিশ্বাসের পরিচালনায় নির্মিত হয়েছে নাটক ‘চাঁদের পালকি’ ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185880', '201302020000'),
(286, 'তবে নামজাদাদের সামনেও এবারের বিপিএল টুর্নামেন্টে দারুণ পারফরম্যান্স দেখাচ্ছেন তারা ।  খুলনার মাঠে নিজেদের সেরাটা নিংড়ে দিয়ে রংপুর রাইডার্সকে এনে দিচ্ছেন একের পর এক জয় ।  খেলোয়াড়দের এমন নৈপুণ্যে বিপিএলে শক্তিশালী দলগুলোর সঙ্গে দারুণ ফাইট দিচ্ছে নবীন দল আবদুর রাজ্জাকের রংপুর রাইডার্স ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184491', '201301240000'),
(287, 'বিবাহিত জীবনের শুরুতেই স্বামী-স্ত্রী একের অপরের প্রতি বিশ্বাস নিয়েই সংসার জীবন শুরু করতে হয় ।  আর যদি তাতে বিন্দুমাত্র অবিশ্বাসের ছাপ থাকে, তাহলে সে সংসারে সুখ থাকে না । এমনই বিষয়বস্তু নিয়ে এগিয়ে যায় নাটকের কাহিনী ।  ', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185881', '201302020000'),
(288, 'দ্বিতীয় ওয়ানডেতে দক্ষিণ আফ্রিকাকে ২৭ রানে হারিয়েছে নিউজিল্যান্ড ।  এতে ওয়ানডে সিরিজ জয় নিশ্চিত করার পাশাপাশি নতুন রেকর্ডও গড়েছে সফরকারীরা ।  দক্ষিণ আফ্রিকার মাটিতে এ প্রথমবারের মতো কোনো ফরম্যাটের ক্রিকেটে সিরিজ জয়ের স্বাদ পেল তারা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184493', '201301240000'),
(289, 'মোহালিতে আগে ব্যাট করতে নেমে ৭ উইকেটে ২৫৭ রান সংগ্রহ করে ইংল্যান্ড ।  জবাবে ৫ উইকেট হারিয়ে জয়ের লক্ষ্যে পৌঁছে যায় ভারত ।  এর আগের দুটি ম্যাচেও জিতেছে ভারতীয়রা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184500', '201301240000'),
(290, 'সদ্য গত হওয়া ভ্যালেন্টাইন ডে অর্থাত্ ১৪ ফেব্রুয়ারির মধ্যে চল্লিশ হাজার নকল! সেসব ভিডিওগুলোও এর মধ্যে এক কোটি ৭৫ লাখ বার ভিউ করা হয় ।  ঘটনাটা এই ।', 'technology', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/20/188752', '201302200000'),
(291, 'কিন্তু ফুটবলপ্রেমীরা মনে করছেন এসি মিলান একটা শক্ত চ্যালেঞ্জ ছুঁড়ে দেবে ।  দু’দলই সাম্প্রতিক সময়ে এ টুর্নামেন্টে অনেক সাফল্য পেয়েছে ।  এসি মিলান সর্বমোট ৭ বার এ ট্রফি জিতেছে; ১৯৯০ থেকে এ পর্যন্ত জিতেছে ৪ বার ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/20/188784', '201302200000'),
(292, 'রোববার সিংহলিজ স্পোর্টস ক্লাবের  হয়ে প্রথম শ্রেণীর ক্রিকেটে স্লিপে ক্যাচ ধরার সময়ে আঙুলে আঘাত পান জয়াবর্ধনে ।  মঙ্গলবার তার আঙুলে অস্ত্রোপচার করা হয়েছে ।  ইনজুরির পরপরই স্ক্যান রিপোর্টে আঙুলে চিড় ধরা পড়েছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/20/188787', '201302200000'),
(293, 'প্রদর্শনীতে শিল্পীর আঁকা ৫৩টি চিত্রকর্ম স্থান পেয়েছে ।  ছবিগুলো প্রদর্শনীর পাশাপাশি বিক্রিও হচ্ছে ।  ২৭ জানুয়ারি শুরু হওয়া প্রদর্শনী শেষ হবে ১ ফেব্রুয়ারি ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/30/185383', '201301300000'),
(294, 'পিছিয়ে থেকেও নাইজেরিয়ান ফরোয়ার্ড কিংসলে চিগোজির জোড়া গোলে ব্রাদার্স ৪-১ গোলে উড়িয়ে দিয়েছে মোহামেডানকে ।  বঙ্গবন্ধু জাতীয় স্টেডিয়ামে শুরুটা পক্ষেই ছিল খেলোয়াড় বিদ্রোহের শিকার মোহামেডানের ।  ৬ মিনিটেই এগিয়ে গিয়েছিল সাদা-কালো জার্সিধারীরা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/30/185343', '201301300000'),
(295, 'রোববার লা লিগায় রিয়ালও ৪-০ গোলে উড়িয়ে দিয়েছে গেটাফকে ।  লিওনেল মেসি-ক্রিশ্চিয়ানো রোনালদো দ্বৈরথও পিছিয়ে নেই ।  গত ম্যাচে বার্সার হয়ে একাই চার গোল করেছেন মেসি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/30/185344', '201301300000'),
(296, 'গতকাল দুপুরে রাজধানীর একটি হোটেলে আয়োজিত এক সাংবাদিক সম্মেলনে হাব এ প্যাকেজ ঘোষণা করে ।  এ সময় লিখিত বক্তব্যে সংগঠনটির নবনির্বাচিত সভাপতি মোহাম্মদ ইব্রাহিম বাহার বলেন, চলতি বছর সর্বমোট ১ লাখ ২৭ হাজার ১৯৮ জন হজযাত্রী হজ পালন করবেন ।  তাদের মধ্যে সরকারি ব্যবস্থাপনায় ১০ হাজার এবং বেসরকারি ব্যবস্থাপনায় ১ লাখ ১৭ হাজার ১৯৮ জন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193597', '201303250000'),
(297, 'কান্দিরপাড় এলাকায় ছোট মুদি দোকান থেকে বৈদ্যুতিক শর্টসার্কিটের মাধ্যমে আগুনের সূত্রপাত হয় ।  মুহূর্তের মধ্যে আগুনের লেলিহান শিখায় পাশের দোকানের তিনটি সিএনজি বেবিট্যাক্সি ও সাদেকের ওয়ার্কশপ পুড়ে ছাই হয়ে যায় ।  এতে ২০ লাখ টাকার ক্ষয়-ক্ষতি হয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185904', '201302020000'),
(298, 'হাতে রয়েছে ১০ উইকেট ।  দুই ওপেনার শিখর দেওয়ান ও মুরালি বিজয় অপরাজিত আছেন ।  অভিষেক টেস্টে শেখর ধাওয়ান চমত্কার ব্যাটিং নৈপুণ্য দেখিয়েছেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/17/192322', '201303170000'),
(299, 'শেক্সপিয়রের নাটককে ভিত্তি করে তৈরি হয়েছিল সে ছবি ।  লিজ টেলরের সঙ্গে মার্ক অ্যান্টনির ভূমিকায় ছিলেন রিচার্ড বার্টন স্বয়ং ।  রুপালি পর্দায় দুজনের প্রেমটাও জমেছিল অনুরূপ ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/22/184194', '201301220000'),
(300, 'স্বচ্ছতা না থাকায় কোটি কোটি টাকা চলে যাচ্ছে সুুবিধাভোগীদের পকেটে ।  এছাড়া বিশ্বের বিভিন্ন দেশের উন্নত কর পদ্ধতি পরিদর্শন ও প্রশিক্ষণের নামে কর্মকর্তাদের বিদেশ ভ্রমণেও খরচ হচ্ছে প্রকল্পগুলোর বড় অংশের টাকা ।  এভাবে বছরের পর বছর এনবিআরে ডিজিটাল করার নামে হরিলুট করছে ঊর্ধ্বতন কর্মকর্তা ও সংশ্লিষ্টরা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/13/182661', '201301130000'),
(301, 'এটি দু’দলেরই দ্বিতীয় ম্যাচ ।  এর আগে  দুরন্ত রাজশাহীর কাছে দুই রানে হারে চিটাগং কিংস ।  একই ভেন্যুতে নিজেদের প্রথম ম্যাচে ঢাকা গ্ল্যাডিয়েটর্সের কাছে ৩৫ রানে হারে রংপুর ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/22/184135', '201301220000'),
(302, 'কিন্তু বিস্ময়করভাবে ভারত সফরে দলে জায়গা হয়নি তার ।  এ ব্যাপারে চেয়ারম্যান জাকা আশরাফ জানিয়েছিলেন, ভারত সফরে না থাকলেও দক্ষিণ আফ্রিকা সফরে ব্যাটিং পরামর্শক হিসেবে নেয়া হবে ইনজামামকে ।  অথচ ভারতের মতো দক্ষিণ আফ্রিকা সফরেও দলে জায়গা হয়নি ইনজামামের ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/22/184145', '201301220000'),
(303, 'অনুসন্ধানে জানা গেছে, পোষ-মাঘ-ফাল্গুন হচ্ছে পাটি বুনার উত্তম সময় ।  আর চৈত্র-বৈশাখে সেই পাটির চাহিদা থাকে ব্যাপক ।  পাটির কাঁচামাল আসে সিলেট থেকে বছরে ২-৩ বার ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/22/184107', '201301220000'),
(304, ' সরকার বিনিয়োগ করলে বাজারকে প্রভাবিত করতে পারবে ।  কিন্তু আমি ব্যক্তিগতভাবে মনে করি এটা একটা ভুল ধারণা  ।  তবে সবকিছুতে সরকারের নিয়ন্ত্রণ ও কর্তৃত্ব থাকা উচিত ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/30/185391', '201301300000'),
(305, 'ভেবেছিলেন আর বুঝি ফেরা হচ্ছে না কাবাডিতে ।  একটা লম্বা সময় সেবাশুশ্রূষা করে ফিরে এসেছেন কাবাডির মহানায়ক ।  বিজিবির এই খেলোয়াড় স্বপ্ন দেখাচ্ছেন এবার বিশ্বকাপে পদক জয়ের ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/weeklies/2013/03/17/1179', '201303170000'),
(306, 'তারা সবগুলো উইকেট হারিয়ে নিউজিল্যান্ডের ছুড়ে দেয়া ৪৪৩ রানের টার্গেটে মাঠে নেমে সংগ্রহ করে মাত্র ২০৪ রান ।  ২৩৯ রানে পিছিয়ে থেকে ফলোঅনে পড়েছিল ইংলিশরা ।  কিন্তু কিউই অধিনায়ক  ব্যাট করার সিদ্ধান্ত নেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193500', '201303250000'),
(307, 'জুটি হিসেবে হিগুইয়েনের ওপর মেসির আস্থা খুব বেশি ।  হিগুইয়েন সম্পর্কে মেসি বলেন, হিগুইয়েন একজন অসাধারণ ফুটবলার, কারণ সে অনেক গোল করছে ।  আমরা যতবারই একসঙ্গে খেলছি, ততই বোঝাপড়া বাড়ছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193501', '201303250000'),
(308, 'জবাবে ৪৪ ওভারে ৪ উইকেট হারিয়েই জয়ের লক্ষ্যে পৌঁছে যায় দক্ষিণ আফ্রিকা ।  দলীয় ৩১ রানের মধ্যেই দুই ওপেনিং ব্যাটসম্যান উইকেট ছাড়া হলে শুরুতেই ব্যাটিং বিপর্যয়ে পড়ে পাকিস্তান ।  প্রোটিয়াদের বোলিং তোপের সামনে পাকিস্তানের কোনো ব্যাটসম্যানই বড় ইনিংস খেলার সুযোগ পাননি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193503', '201303250000'),
(309, 'সর্বশেষ গত ২০০৯ সালের ডিসেম্বরে ২০ কোটি টাকা ঋণ দেয়া হয়েছিল ।  ব্যাংকটির বিভিন্ন উত্স থেকে সংগ্রহীত তহবিলের পরিমাণ ২১৬ কোটি টাকা ।  অথচ বর্তমানে তাদের বকেয়া রয়েছে ২৩৩ কোটি টাকা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184556', '201301240000'),
(310, 'ভারতের এ দাবির সঙ্গে এবার একমত পোষণ করেছেন বিশ্বক্রিকেটের অভিভাবক সংস্থা আইসিসি প্রধান নির্বাহী ডেভ রিচার্ডসন ।  আইসিসি চায় না ভারত এ প্রযুক্তি ব্যবহার করুক ।  পাঁচ বছর আগে ডিআরএস প্রথা শুরুর পর নতুন এ প্রযুক্তির বিপক্ষে চলে যায় ভারত ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193504', '201303250000'),
(311, 'স্ট্রোকে গোল আদায় করে শাকিল ।  নির্ধারিত সময়ে অমীমাংসিত থাকায় ম্যাচের ভাগ্য গড়ায় টাইব্রেকারে ।  টাইব্রেকারে উভয় দল ৫ স্ট্রোকে চারটি করে গোল করে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193505', '201303250000'),
(312, 'এদিকে চলতি বছরের হজ প্যাকেজ ঘোষণা করেছে ধর্ম মন্ত্রণালয় ।  গত সোমবার মন্ত্রিসভায় প্যাকেজটি অনুমোদন  হয় ।  এতে সরকারি ব্যবস্থাপনায় দুটি প্যাকেজ ঘোষণা করা হয় ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/17/192357', '201303170000'),
(313, 'এর মানে লঙ্কা সফরের বাকি ম্যাচগুলোতে থাকছেন না তামিম ।  আজ দেশে চলে আসবেন তিনি ।  তামিমের জায়গায় ডাক পেয়েছেন এবারের বিপিএল টি-টোয়েন্টিতে ব্যাটিং নৈপুণ্য দেখানো শামসুর রহমান ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193506', '201303250000'),
(314, 'এতে করে সবজি বাইরে যেতে না পারায় বাজারে দরপতন দেখা দিয়েছে ।  প্রতিকেজি গ্রান্ডউলা আলু ৩ টাকা ও বেগুন ১ থেকে দেড় টাকা দরে বিক্রি হচ্ছে ।  অপরদিকে বিক্রেতারা প্রতিকেজি করলা ৬০ টাকা দরে বিক্রি করছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193481', '201303250000'),
(315, 'চিনি আহরণের লক্ষ্যমাত্রা ছিল ৭.৫% আর চিনি আহরণ হয় ৬.২৯% ।  ১৯৭৬ সালে মিলটির পরীক্ষামূলক উত্পাদন শুরু করে ।  এ মিলের মাড়াই ক্ষমতা বছরে ১০ হাজার ৬১ মেট্রিক টন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193488', '201303250000'),
(316, 'তাহলে বিষয়টা দাঁড়িয়েছে এমন, আগের মুদ্রানীতিতে মুদ্রা সরবরাহ লক্ষ্যমাত্রার চেয়ে বেশি বাড়ানো হলেও বেসরকারি খাতে ঋণ প্রবৃদ্ধি ছিল প্রস্তাবের তুলনায় কম ।  এর থেকে ধরে নেয়া যায়, বেসরকারি খাতের উদ্যোক্তারা প্রত্যাশা অনুযায়ী ঋণ পাননি অথবা ঋণ নিতে আগ্রহী হননি ।  উভয় সিদ্ধান্তই অর্থনীতির খুঁড়িয়ে চলার লক্ষণ ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/186000', '201302020000'),
(317, 'গতকাল এ সমীক্ষার প্রাথমিক খসড়া প্রকাশ করে বিবিএস ।  পরিসংখ্যান ও তথ্য ব্যবস্থাপনা বিভাগের সচিব নজিবুর রহমান অনুষ্ঠানে প্রধান অতিথি ছিলেন ।  বিবিএস মহাপরিচালক গোলাম মোস্তফা কামালের সভাপতিত্বে অনুষ্ঠানে আরও উপস্থিত ছিলেন বিবিএসের উপ-মহাপরিচালক।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193513', '201303250000'),
(318, 'দলীয় ৪৬ রানে প্রোটিয়া এই দুই ওপেনারকে সাজঘরে ফিরিয়ে দেন জুনায়েদ খান ।  ২০ রান করে জুনায়েদ খানের বলে হাফিজের হাতে ক্যাচ দেন পিটারসেন ।  গ্রায়েম স্মিথ আউট হন উমর গুলের বলে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185944', '201302020000'),
(319, 'তাই নিজেই বিষণ্নতায় ভুগছিলেন ।  অবশেষে ক্যারিয়ার বাঁচানোর চেষ্টায় আবারও মিলানে ফিরে এসেছেন বালোতেল্লি ।  প্রায় ত্রিশ মিলিয়ন ডলারে তাকে কিনে নিয়েছে মিলান ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185945', '201302020000'),
(320, 'কনফেডারেশন কাপ শেষ হতে না হতেই আবারও ময়দানি লড়াইয়ে দেখা যাবে ব্রাজিলকে ।  সুইজারল্যান্ডের বিপক্ষে আগামী ১৪ আগস্ট সফরকারীরা একটি প্রীতি ম্যাচ খেলবে ।  ব্রাজিলিয়ান ফুটবল কনফেডারেশন একথা জানায় ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185946', '201302020000'),
(321, 'আগে সাধারণভাবে দাম বাড়ার বিষয়টি ছিল মৌসুমভিত্তিক ।  এখন এসব সোজাসাপটা হিসাব আর মিলছে না ।  ধানের দাম কম অথচ ধানের পেট থেকে বেরুনো চালের দাম আকাশচুম্বি ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184466', '201301240000'),
(322, 'জবাবে ১৭০ রানে গুটিয়ে যায় দক্ষিণ আফ্রিকার ইনিংস ।  অপর ম্যাচে পাকিস্তানের বিপক্ষে ৯১ রানের জয় পেয়েছে অস্ট্রেলিয়া ।  কটকের বারবতি স্টেডিয়ামে আগে ব্যাট করতে নেমে সব উইকেট হারিয়ে ১৭৫ রান সংগ্রহ করে অজিরা ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185948', '201302020000'),
(323, 'স্বপন কুমার বালা ঢাকা বিশ্ববিদ্যালয়ের অ্যাকাউন্টিং অ্যান্ড ইনফরমেশন সিস্টেমস বিভাগের শিক্ষক ।  প্রসঙ্গত, গত ৯ জানুয়ারি ড. মোশাররফ হোসেন সিইও থেকে পদত্যাগ করার পর পদটি শূন্য রয়েছে ।  বর্তমানে ডিএসইর প্রধান অর্থ কর্মকর্তা শুভ্রকান্তি চৌধুরী ভারপ্রাপ্ত সিইও হিসেবে দায়িত্ব পালন করছেন ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193534', '201303250000'),
(324, 'এটা নতুন সময়ের ছবি ।  এ ছবি মানুষকে দেখানো দরকার ।  নতুন দিনের সিনেমার বিকাশে সরকার নানা পদক্ষেপ নিয়েছে এর মধ্যেই ।', 'entertainment', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/25/193536', '201303250000'),
(325, 'তবে বাংলাদেশের ট্রেন যোগাযোগে যুক্ত হয়নি কোনো আধুনিকতা ।  রেললাইন সংস্কার, সম্প্রসারণ এবং কোচ ও সেবার মান এখনও প্রায় অপরিবর্তিত ।  দুনিয়ার অন্যান্য প্রান্তে যখন পাতাল রেলসহ নতুন নতুন দ্রুতগামী ট্রেন যুক্ত হচ্ছে, তখন আমাদের দেশে চোখে পড়ে ট্রেনের বেহাল দশা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184469', '201301240000'),
(326, 'শেষদিকে কেভিন ব্রেইন সর্বোচ্চ ২৪ রান করে অপরাজিত থাকেন ।  এছাড়া ২৬ বলে ২৩ রান করেন হিয়াট ।  নাসির হোসেন করেছেন ২১ রান ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/30/185349', '201301300000'),
(327, 'নিজকুঞ্জরা ক্রিকেট একাদশ ১২০ রানের বিশাল ব্যবধানে প্রতিপক্ষ দলকে পরাজিত করে ।  বিজয়ী দলের অধিনায়ক আবু ছালেক ম্যাচসেরা নির্বাচিত হন ।  খেলা পরিচালনা করেন তানজীর হোসেন টিপু ও সুব্রত রায় চৌধুরী ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/30/185351', '201301300000'),
(328, 'বাংলাদেশের অর্থনীতির গুরুত্বপূর্ণ খাত তৈরি পোশাক শিল্পের বর্তমান অবস্থা সে কারণেই গভীর উদ্বেগ সৃষ্টি করেছে ।  সঙ্কটের আবর্তে ঘুরপাক খাচ্ছে দেশের শতভাগ রফতানিমুখী তৈরি পোশাক খাত ।  গতকালের দৈনিক আমার দেশ এ নিয়ে একটি তথ্যভিত্তিক রিপোর্ট প্রকাশ করেছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/20/188774', '201302200000'),
(329, 'বাংলাদেশে আরব আমিরাতের বিনিয়োগের সম্ভাবনা খতিয়ে দেখতে তিনি গতকাল সকালে ঢাকা আসেন ।  বাংলাদেশের সংশ্লিষ্ট কর্তাব্যক্তিদের সঙ্গে আলোচনা শেষে গতকাল বিকালেই তিনি দেশে ফিরে গেছেন ।  সাংবাদিকদের প্রশ্নের জবাবে আমিরাতের মন্ত্রী বলেন, পররাষ্ট্রমন্ত্রীর সঙ্গে বৈঠকে দ্বিপক্ষীয় সহযোগিতার বিভিন্ন বিষয় নিয়ে আলোচনা হয়েছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/30/185360', '201301300000'),
(330, 'গতকাল রাজধানীর এনইসি সম্মেলন কক্ষে টেকসই উন্নয়ন লক্ষ্যমাত্রার এসডিজি প্রাথমিক খসড়ার ওপর আলোচনা সভায় তিনি এসব কথা বলেন ।  জাতিসংঘ ঘোষিত সহস্রাব্দ উন্নয়ন লক্ষ্যমাত্রার এমডিজি মেয়াদকাল শেষ হচ্ছে ২০১৫ সালে ।  পরবর্তী সময়ের উন্নয়ন লক্ষ্যমাত্রা নির্ধারণে এসডিজি প্রণয়ন করা হচ্ছে ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/22/184236', '201301220000'),
(331, 'এর মধ্যে ঢাকার মাঠে দুরন্ত রাজশাহী ও খুলনার মাঠে রংপুর রাইডার্সের বিপক্ষে দুটি ম্যাচ খেলে দুটিতেই হারতে হয়েছে তাদের ।  আজ সকাল ১০টায় শুরু হওয়া নিজেদের তৃতীয় ম্যাচে খুলনার শেখ আবু নাসের স্টেডিয়ামে বরিশাল বার্নার্সের মুখোমুখি হচ্ছে চিটাগং কিংস ।  বরিশালের জন্যও এটা চতুর্থ ম্যাচ ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184492', '201301240000'),
(332, 'চলতি টুর্নামেন্টের শুরু থেকেই ইনজুরিতে ভুগছিলেন সেরেনা ।  ১৯ বছর বয়সী স্লোয়ান ২ ঘণ্টা ১৭ মিনিটের লড়াইয়ে প্রথম সেটে ৩-৬ গেমে পিছিয়ে পড়েও পরের দুই সেট জিতে নেন ৭-৫ ও ৬-৪ গেমে ।  নিজের ফেভারিট প্রতিদ্বন্দ্বীকে হারাতে পেরে খুশিতে আত্মহারা স্লোয়ান সাংবাদিকদের বলেন, ‘অবাক লাগছে ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184495', '201301240000'),
(333, 'ফাঁকা গ্যালারি দর্শকে পরিপূর্ণ রাখতে চেষ্টা করে যাচ্ছেন ।  গত আসরের মতো জমকালো কিছু করে দেখাতে না পারলেও ঢাকা ও খুলনার মতো গ্যালারি যেন দর্শকশূন্য না থাকে সেই চেষ্টাই করে যাচ্ছেন তারা ।  এজন্য নানা উদ্যোগও নিয়েছেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/01/24/184496', '201301240000'),
(334, 'এ অবস্থায় চলতি বছর সিইউএফএল আর চালু নাও হতে পারে বলে আশঙ্কা প্রকাশ করেছেন সংশ্লিষ্টরা ।  আর তাতে কারখানাটিকে গুনতে হতে পারে বিপুল অঙ্কের ক্ষতি ।  ব্যাহত হতে পারে উত্পাদন লক্ষ্যমাত্রা ।', 'business', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/02/185987', '201302020000'),
(335, 'বঙ্গবন্ধু জাতীয় স্টেডিয়ামে অনুষ্ঠিত ম্যাচের ১১ মিনিটেই এগিয়ে যাওয়ার সুযোগ এসেছিল মোহামেডানের সামনে ।  কিন্তু দলের ঘানাইয়ান ফরোয়ার্ড ওসাই মরিসনকে বক্সে ট্যাকল করেন আরামবাগের ক্যামেরুন খেলোয়াড় জেরার্ড ।  রেফারি পেনাল্টির বাঁশি দেন ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/02/20/188781', '201302200000'),
(336, 'একই মাঠে বিকাল ৫টা ১৫ মিটিনে ‘এ’ গুপে ঢাকা মোহামেডান নৌ-বাহিনীর মুখোমুখি হবে । সন্ধ্যা ৭টা ১৫ মিনিটে ফ্লাড লাইটের আলোতে অনুষ্ঠিত হবে ‘এ’ গুপে থাকা গতবারের রানার্স-আপ শেখ জামাল ও ফেনী সকারের ম্যাচটি ।  এটি স্বাধীনতা কাপ ফুটবলের দ্বিতীয় আসর ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/17/192321', '201303170000'),
(337, 'এজন্য উচ্ছ্বসিত এই রাশিয়ান টেনিস তারকা ।  ইন্ডিয়ান ওয়েলসের ফাইনাল নিশ্চিত করার পর শারাপোভা বলেন, এই সপ্তাহের দারুণ অর্জনে অনেক লাগছে ।  তবে সব ভালো লাগার পূর্ণতা পাবে যদি হাতে শিরোপা ওঠাতে পারি ।', 'sports', 'www.amardeshonline.com', 'http://www.amardeshonline.com/pages/details/2013/03/17/192323', '201303170000');
